(86, 86, 'CLICKDAY2016 - pagina facebook', 'Bentrovati! \r\nDa quando, oh cliccatori, vi siete registrati: zero spamming.\r\nE'' ora di un pò di sostanza. Se volete dare visibilità al ns progetto potete mettere un “Mi piace” sulla pagina di facebook \r\nhttps://www.facebook.com/clickday/?fref=ts ?\r\nGrazie!\r\nLì trovate le foto dello scorso anno e anche i primi trucchi da pistoleri del mouse.\r\nAltri trucchi arriveranno.\r\nSTATE SINTONIZZATI. CLICKDAY\r\nPC01', '2016-02-18 15:49:00', -1, -9, -1),
