(185, 89, 'Conferma Iscirzione', 'Buongiorno Sig. Beatrice,\r\n\r\ndeve confermare l''iscrizione.\r\nControlli anche nella posta indesiderata.\r\n\r\nCordiali saluti', '2016-04-06 07:32:00', 208, -24, -1),
(186, 86, 'prova da click master', 'ti arriva la mail?', '2016-04-06 10:28:00', 53, -24, -1),
(187, 237, 'Contratto ', 'Buongiorno! Non ho la possibilità di stampare il contratto per firmarlo e poi ricaricarlo ', '2016-04-08 10:01:00', 154, -3, -1),
(188, 4, 'RE: Contratto ', 'Buongiorno Simona,\r\nnon si preoccupi, potrà inviare il contratto successivamente. La data del Click Day sarà indicativamente nelle prime settimane di giugno, quindi c’è ancora tempo.\r\nIn ogni caso, lei è già registrata ed è ufficialmente una cliccatrice!\r\nGrazie\r\n', '2016-04-08 10:23:00', 237, -27, 187),
(189, 262, 'Caricamento contratto Click Day', 'La fase di caricamento del contratto firmato va in errore con il messaggio "Si è verificato un errore inaspettato, probabilmente il file selezionato non è corretto". Il Il contratto da inviarVi è in pdf dimensione 2,44 MB. Resto in attesa di indicazioni. Cordialmente, Luca Camorani', '2016-04-12 07:17:00', 144, -3, -1),
(190, 3, 'RE: Caricamento contratto Click Day', 'Buongiorno Luca,\r\n\r\ngrazie per averci informato, abbiamo provveduto a risolvere il problema.\r\nTi preghiamo di effettuare nuovamente l''operazione, nel caso il problema sussistesse, non esitare a contattarci.\r\n\r\nGrazie ancora e buon click!\r\n\r\nIl team di Click Day', '2016-04-12 13:52:00', 262, -27, 189),
(191, 262, 'RE: RE: Caricamento contratto Click Day', 'Buongiorno. Purtroppo l''errore persiste. Non risulta possibile il caricamento del contratto. Luca Camorani', '2016-04-12 14:29:00', 3, -23, 189),
(192, 3, 'RE: RE: RE: Caricamento contratto Click Day', 'Ci scusiamo per questo disagio. Abbiamo apportato ulteriori modifiche e ora dovremmo aver identificato e risolto il problema. Le chiedo gentilmente un''ulteriore prova di upload. Rimaniamo a disposizione per qualsiasi evenienza.\r\n\r\nIn attesa di un Suo riscontro, le auguriamo una buona serata.\r\n\r\nIl team di Click Day', '2016-04-12 15:50:00', 262, -27, 189),
(193, 262, 'RE: RE: RE: RE: Caricamento contratto Click Day', 'Mi dispiace ma purtroppo non funziona ancora. Nè da Explorer nè da Chrome. L''errore è sempre lo stesso "Si è verificato un errore inaspettato, probabilmente il file selezionato non è corretto".  Fatemi cortesemente sapere. Cordiali saluti. Luca Camorani', '2016-04-12 16:44:00', 3, -23, 189),
(194, 3, 'RE: RE: RE: RE: RE: Caricamento contratto Click Day', 'Buongiorno Luca,\r\n\r\nabbiamo provato a riprodurre il problema sui nostri terminali. Ti chiediamo la cortesia di riprovare l''upload del file. Se il problema sussistesse,  ti chiediamo  di provare a salvare nuovamente il contratto in formato pdf o anche jpg e riprovare nuovamente con l''upload. Nel caso in cui non venga risolto il problema, i nostri tecnici la contatteranno telefonicamente per assisterla nella risoluzione.\r\nIn attesa di un suo riscontro, le auguriamo una buona giornata.\r\n\r\nIl Team di Click Day', '2016-04-13 09:30:00', 262, -27, 189),
(195, 262, 'RE: RE: RE: RE: RE: RE: Caricamento contratto Click Day', 'Ok grazie. Ho caricato il contratto in formato immagine e non mi ha dato problemi. Evidentemente il problema era nella dimensione del pdf che continua a dare errore. Comunque così ho risolto. Grazie. Cordiali saluti. Luca Camorani', '2016-04-13 10:21:00', 3, -23, 189),
(196, 3, 'RE: RE: RE: RE: RE: RE: RE: Caricamento contratto Click Day', 'Siamo lieti di aver risolto  questo inconveniente. Non esiti a contattarci per qualsiasi  altra evenienza.\r\n\r\nBuona giornata e buon click!\r\n\r\nIl Team di Click Day', '2016-04-13 11:24:00', 262, -27, 189),
(199, 325, 'progetto', 'ciao, mi sono appena iscritto,  mi piacerebbe sapere di piu sul progetto.', '2016-04-22 07:55:00', 88, -3, -1),
(200, 331, 'Domanda', 'Come funziona? Cosa dovrei fare?', '2016-04-22 08:24:00', 88, -3, -1),
(201, 88, 'RE: Domanda', 'Salve Ilaria,\r\n\r\nl’attività consiste in un copia/incolla/invio di un codice su una pagina web, in un determinato giorno ad una determinata ora.\r\n\r\nSe l’attività viene eseguita in maniera celere, il progetto abbinato al suo codice passa in graduatoria utile, e lei ottiene il compenso.\r\n\r\nLa graduatoria sarà pubblicata sul sito dell’INAIL circa una settimana dopo.\r\n\r\nIl 19 maggio ci comunicheranno la data esatta del click day.\r\n\r\nVerrà aggiornata tramite mail e le verrà fornita una piattaforma sulla quale allenarsi per eseguire l’attività nel minor tempo possibile.\r\n\r\nA disposizione.\r\n', '2016-04-22 11:24:00', 331, -24, 200),
(202, 88, 'RE: progetto', 'Eccoci Ernest,\r\n\r\nl’attività consiste in un copia/incolla/invio di un codice su una pagina web, in un determinato giorno ad una determinata ora.\r\n\r\nSe l’attività viene eseguita in maniera celere, il progetto abbinato al suo codice passa in graduatoria utile, e lei ottiene il compenso.\r\n\r\nLa graduatoria sarà pubblicata sul sito dell’INAIL circa una settimana dopo.\r\n\r\nIl 19 maggio ci comunicheranno la data esatta del click day.\r\n\r\nVerrà aggiornata tramite mail e le verrà fornita una piattaforma sulla quale allenarsi per eseguire l’attività nel minor tempo possibile.\r\n\r\nA disposizione.\r\n', '2016-04-22 11:25:00', 325, -24, 199),
(203, 353, 'contratto', 'Salve,\r\n      il contratto firmato glielo giro tramite posta normale?\r\nSaluti', '2016-04-22 13:04:00', 88, -3, -1),
(204, 88, 'RE: contratto', 'Ricevuto. La ringrazio.\r\nSe vuole mettere a conoscenza dell''opportunità parenti e amici, occorre solamente che  si iscrivano con il codice click master 02MG.\r\n\r\nSaluti', '2016-04-22 13:12:00', 353, -24, 203),
(207, 454, 'Richiesta info', 'Buon giorno, mi sono registrata e quindi si è attivato il profilo.\r\nHo letto un pò di informazioni e chiedo quanto segue:\r\n1) devo caricare il contratto firmato?\r\n2) Doveva partecipare anche la mia azienda a questo bando, ma avendo già ricevuto un contributo inail negli ultimi 3 anni non abbiamo potuto presentare domanda. Sono pertanto a conoscenza, che ci sarà una data ed un''orario ben preciso per inviare questo "codice" attraverso il sito dell''inail.\r\nLa mia domanda è: avrò un''unica password di accesso al sito INAIL come studio ATS? per inviare tutti i codici? o ad ogni ditta che partecipa devo inserire le password ed inviare? Sopratutto mi verrebbero assegnate un numero definito di codici? \r\nSpero di essere stata chiara.\r\nCordiali Saluti\r\n\r\n', '2016-04-26 13:42:00', -1, -1, -1),
(208, 5, 'RE: Richiesta info', 'Buongiorno Concetta,\r\n      grazie per esserti registrata! Il contratto firmato puoi caricarlo sia ora sia successivamente, quando ti fa comodo possibilmente entro la data del clickday che comunicherà l’INAIL a partire dal 19 maggio 2016.\r\nLa procedura INAIL negli ultimi anni è stata modificata (forse tu ricordi quella del 2012), nel senso che non vi è più la necessità di accedere con le credenziali dell’Azienda al portale. L’INAIL comunicherà un link ad una pagina statica, uguale per tutte le domande di progetto, dal quale inviare il codice progetto (unico ad azienda e generato dall’INAIL)\r\nTale codice, la procedura e altre info vi verranno comunicate da ATS al più presto appena l’INAIL pubblicherà le procedure definitive a la data del clickday. Vi invieremo anche un breve video tutorial sul momento del click.\r\n\r\nPer riassumere ti invieremo un codice progetto, alfanumerico, generato dall’INAIL ed associato ad un’unica azienda ovviamente. Nel file con il codice progetto troverai la ragione sociale dell’Azienda a te assegnata e la Regione nella quale ha sede l’unità produttiva dell’azienda che presenta il progetto in modo che possiate verificare il vostro posizionamento (tempo di invio) non appena l’INAIL pubblicherà gli elenchi cronologici con le ammissibilità entro una settimana dal clickday.\r\n\r\nRimango a disposizione\r\n\r\nAlessandro Faletti\r\nATS - CONSULENTI ASSOCIATI S.r.l.', '2016-04-26 13:58:00', 454, -27, 207),
(209, 89, 'Click day 2016', 'Buongiorno, deve confermare la sua iscrizione.\r\n\r\nCordiali Saluti', '2016-04-27 09:18:00', 458, -24, -1),
(210, 321, 'incarico di lavoro autonomo occasionale ', 'Buongiorno \r\nin allegato alla presente allego copia dell''incarico di lavoro autonomo occasionale debitamente controfirmato.\r\n\r\nDistinti saluti \r\n\r\nOriella Pasini ', '2016-04-27 12:26:00', 88, -3, -1),
(211, 494, 'mi sono registrata', 'buongiorno sono riuscita a registrarmi con successo e spero che quello che ho letto nelle istruzioni sarà mantenuto!', '2016-04-27 13:24:00', 88, -3, -1),
(212, 494, 'contratto per partecipare', 'buongiorno volevo sapere quando devo scaricare, firmare e caricare il contratto di collaborazione che ho letto.\r\naspetto vs. istruzioni\r\nMaya Marangon', '2016-04-27 13:26:00', 88, -3, -1),
(213, 497, 'registrazione effettuata', 'sono riuscita a registrarmi con successo ora aspetto vs. notizie', '2016-04-27 13:34:00', 88, -3, -1),
