(227, 4, 'Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Ciao!\r\nNei prossimi giorni riceverai tutte le informazioni su cosa dovrai fare il giorno del Click Day, incluso un video tutorial che ti mostrerà la procedura passo dopo passo.\r\nTi comunicheremo anche la data esatta a partire dal 19 maggio.\r\n\r\nNel frattempo non dovrai fare nulla, se non continuare a seguirci su Facebook dove potrai trovare tante informazioni utili!\r\nhttps://www.facebook.com/clickday/\r\n\r\nBuona giornata!', '2016-05-02 14:21:00', -1, -15, -1),
