(273, 664, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'ciao,\r\nnon ho ancora ricevuto le istruzioni e il video tutorial per il Click Day.\r\nResto in attesa di una tua gentile risposta.\r\nGiorgio', '2016-05-13 10:28:00', 4, -23, 227),
(274, 946, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Ciao Vanessa.\r\nVolevo sapere se devo scaricare e firmare il contratto qui sotto alla pagina o devo aspettare una vostra comunicazione.  E quando devo fornire i miei dati bancari???', '2016-05-13 10:57:00', 4, -23, 227),
(275, 3, 'RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno Samantha,\r\n\r\npuoi procedere alla compilazione del contratto e a ricaricarlo nell''apposito spazio nell''area personale. Se il tuo click risulterà vincente, il team di Click Day provvederà a contattarti e richiedere tutte le informazioni riguardo anche i dati bancari, per procedere con il pagamento.\r\nNel caso di ulteroriori informazioni, non esitare a contattarci!\r\n\r\nGrazie,\r\n\r\nIl team di Click Day', '2016-05-13 11:27:00', 946, -27, 227),
(276, 3, 'RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno Giorgio,\r\n\r\nistruzioni e video tutorial saranno pubblicati e inoltrati agli utenti nel giro dei prossimi giorni. Ti preghiamo di pazientare ancora qualche giorno e riceverai tutte le informazioni necessarie dal nostro team!\r\n\r\nNel caso di maggiori informazioni, non esitare a contattarci.\r\n\r\nGrazie,\r\n\r\nIl team di Click Day', '2016-05-13 11:29:00', 664, -27, 227),
(277, 669, 'RE: Conferma Iscrizione', 'Salve,\r\nper la conferma dell'' iscrizione devo solo rispondere al seguente messaggio o devo (adesso o prima del 19 maggio) firmare il contratto?\r\n\r\nCordiali saluti,\r\nAlessandro Clocchiatti', '2016-05-13 11:32:00', 89, -22, 268),
(279, 89, 'RE: RE: Conferma Iscrizione', 'Deve confermare l''iscrizione dalla mail che le è arrivata dopo l''iscrizione.\r\ncontrolli anche in posta indesiderata.\r\n\r\ncordiali saluti', '2016-05-13 13:34:00', 669, -24, 268),
(280, 669, 'RE: RE: RE: Conferma Iscrizione', 'Ho trovato la mail con oggetto "Registrazione ClickDay 2016" e ho confermato la mia registrazione (ho ricevuto la mail con oggetto "Conferma Attivazione ClickDay 2016"). Spero abbia fatto il tutto nel modo corretto.\r\n\r\nCordiali saluti,\r\nClocchiatti Alessandro', '2016-05-13 14:24:00', 89, -22, 268),
(281, 89, 'RE: RE: RE: RE: Conferma Iscrizione', 'Adesso è tutto  a posto.\r\nresti in attesa delle info e dei tutorial.\r\n\r\ncordiali saluti', '2016-05-13 14:28:00', 669, -24, 268),
(283, 963, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Ciao Vanessa, scusa volevo chiedere due cose.\r\n1) Mi par di aver capito che quelli che cliccano fanno inserire i codici delle aziende che partecipano al bando per avere contributi a fondo perduto per fare investimenti sulla sicurezza. Ma il mio dubbio é: dato che il bando é a sportello, quelli che cliccano solo gli unici responsabili della vincita dei partecipanti al bando?\r\n2) Io mi occupo di audiovisivi e ho la partita iva col regime dei minimi (quella con la tassazione del 5% e faccio le fatture senza iva): in questo caso faccio una fattura?\r\n', '2016-05-13 15:12:00', 4, -23, 227),
(284, 989, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Salve,si può anche utilizzare il giorno del click day lo smartphone o il pc??', '2016-05-14 13:30:00', 4, -23, 227),
(286, 3, 'RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno Paolo,\r\n\r\nla procedura di click dovrà essere esclusivamente effettuata tramite pc o mac, desktop o portatile. \r\n\r\nNel caso  di ulteriori domande, non esitare  a contattarci!\r\n\r\nBuona giornata,\r\n\r\nIl team di Click Day\r\n', '2016-05-16 09:32:00', 989, -27, 227),
(287, 1039, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Salve, non mi fa scaricare il contratto.', '2016-05-16 12:35:00', 4, -23, 227),
(288, 1051, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'ma i dati per il bonifico quando li devo inserire?\r\n', '2016-05-16 14:31:00', 4, -23, 227),
