(293, 89, 'RE: RE: RE: informazioni', 'Mi dispiace Sig. Gabriella, nell''annuncio c''è scritto singola chiamata.\r\n', '2016-05-16 15:43:00', 1051, -24, 289),
(294, 3, 'RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buonasera Teresa,\r\n\r\nIl cliccatore non ha nessun tipo di responsabilità e può essere pagata con regolare fattura.', '2016-05-16 17:16:00', 963, -27, 227),
(295, 963, 'domanda', 'Grazie Nicola. Volevo chiedere un''altra cosa: c''è scritto nel sito che puoi avere i 300 euro solo se il tuo click arriva tra i primi. ma entro quando esattamente? nella faq c''è scritto che hai mezz''ora. quindi vuol dire che chi clicca al 31 minuto è fuori e chi clicca entro il 30 minuto è dentro? quanti click massimo saranno presi in considerazione? ', '2016-05-16 18:22:00', 3, -23, 227),
(296, 3, 'RE: domanda', 'Buonasera Teresa,\r\n\r\ntra pochi giorni pubblicheremo un video tutorial esplicativo di tutta l''operazione richiesta, che potrà di sicuro chiarire il procedimento. L''operazione di invio del codice progetto è questione di millesimi di secondo, ed è un''operazione unica per ogni utente. A giorni le verrà inviato un codice progetto, da immettere in un campo di testo, che apparirà su una specifica schermata sul portale INAIL, in una determinata ora di un particolare giorno, presumibilmente nel mese di giugno (comunicheremo queste informazioni a tutti gli utenti iscritti appena ci verranno comunicate da INAIL).  L''operazione richiesta sarà appunto di immettere il codice nel minor tempo possibile, non appena la specifica schermata si aprirà. i 30 minuti sono comprensivi della preparazione del proprio pc/mac, del accesso al portale INAIL, dell''immissione del codice progetto e delle successive operazioni post click, necessarie per aggiudicarsi i premi in caso di vittoria, ma l''operazione di immissione del codice progetto sarà unica per ogni utente e dovrà svolgersi nell''arco di pochi centesimi di secondo.\r\nCon la speranza di essere stato  esaustivo, la invito comunque a seguire la nostra pagina  Facebook, sulla quale nei prossimi giorni pubblicheremo il suddetto video.\r\n\r\nLe auguro una buona serata.', '2016-05-16 18:45:00', 963, -27, 227),
(297, 963, 'RE: RE: domanda', 'ah ok grazie. molto esaustivo grazie. scusa se insisto su un punto però:  è vero che questi codici che manderete sono i codici delle aziende che partecipano al bando? se sì, le aziende che vincono il contributo sono quelle che arrivano entro quale numero cronologico?  (per capirci vincono per esempio le prime 100?)', '2016-05-16 18:55:00', 3, -23, 227),
(298, 3, 'RE: RE: RE: domanda', 'Per ogni azienda che, tramite ATS - Consulenti Associati, sottopone un progetto per ottenere i finanziamenti, INAIL rilascerà un codice progetto. I progetti verranno finanziati fino  ad esaurimento fondi, ossia quando la somma dei finanziamenti inoltrati tramite il Click Day raggiungerà il valore dei fondi predefiniti. Questo non limita quindi a un numero chiuso, ma viene calcolato sulla base della somma algebrica dei vari progetti, fino ad esaurimento fondi. ', '2016-05-16 19:06:00', 963, -27, 227),
(299, 963, 'RE: RE: RE: RE: domanda', 'Scusami Nicola, ma quindi se i progetti verranno finanziati fino ad esaurimento fondi, vuol dire che noi che clicchiamo siamo parecchio responsabili dei progetti, o no?', '2016-05-16 19:50:00', 3, -23, 227),
(300, 736, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno, desideravo sapere quando riceverò il video tutorial e se posso già caricare il contratto firmato o deve aspettare di essere a conoscenza della data esatta del Click Day. La ringrazio. Cordiali saluti. Matteo', '2016-05-17 07:24:00', 4, -23, 227),
(301, 3, 'RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno Matteo,\r\n\r\npuò iniziare a caricare il contratto sin da ora, l''importante è che avvenga prima del giorno del Click Day. Il video tutorial verrà pubblicato nei prossimi giorni, provvederemo a inviarne copia a tutti gli utenti iscritti.\r\n\r\nPer qualsiasi altra informazione non esiti a contattarci, Grazie!\r\n', '2016-05-17 07:56:00', 736, -27, 227),
(302, 736, 'RE: RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Anche se nel contratto nella parte relativa al giorno del servizio non c''è scritto ancora nulla? o mi conviene aspettare che la data sia comunicata il 19 maggio? La ringrazio ancora', '2016-05-17 08:00:00', 3, -23, 227),
(303, 3, 'RE: RE: RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Può certamente aspettare, non appena aggiorneremo il contratto le invieremo comunicazione a riguardo.\r\nGrazie', '2016-05-17 08:10:00', 736, -27, 227),
(304, 1082, 'info contratto ', 'Salve, una volta effettuata la registrazione, vi devo consegnare anche il contratto firmato?  Grazie', '2016-05-17 08:34:00', 89, -3, -1),
(305, 89, 'RE: info contratto ', 'Buongiorno,\r\nno in questo momento non serve.\r\nIntanto è incompleto perchè manca la data ( la sapremo a fine settimana)\r\nPoi completeremo il contratto e verrà firmato da noi.\r\n\r\nA noi serve alla fine.', '2016-05-17 08:51:00', 1082, -24, 304),
