(308, 1123, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Perfetto. grazie', '2016-05-17 20:17:00', 4, -23, 227),
(309, 1124, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Perfetto grazie. Daniele', '2016-05-17 20:24:00', 4, -23, 227),
(310, 5, 'RE: RE: RE: RE: RE: domanda', 'Buongiorno Teresa,\r\n                sono Alessandro, un collega di Nicola e Responsabile ATS del Progetto. I cliccatori non hanno responsabilità alcuna della buona riuscita o meno dell’invio in tempo utile del codice progetto, il contratto stipulato è fra le aziende che desiderano partecipare al BANDO ed ATS – CONSULENTI ASSOCIATI S.r.l.\r\nPer intenderci il cliccatore non avrebbe alcuna responsabilità nemmeno con ATS nel caso in cui inviasse il contratto firmato poi decidesse di non effettuare il click.\r\n\r\nSe hai altri dubbi chiamami pure allo 0522/701079 o al 339/6659105\r\n\r\nSaluti Cordiali!\r\nAlessandro Faletti\r\n', '2016-05-18 07:08:00', 963, -27, 227),
(311, 1132, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Ok, perfetto !', '2016-05-18 07:17:00', 4, -23, 227),
(312, 1135, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Grazie per questa opportunità..buona giornata\r\n\r\n', '2016-05-18 08:25:00', 4, -23, 227),
(313, 4, 'RE: chiarimenti', 'Buongiorno,\r\nsì, può farlo ugualmente.\r\nL''unico caso in cui non potrebbe farlo è se lei fosse un dipendente della pubblica amministrazione, in quel caso, la legge vieta di avere più di un contratto in essere.\r\nBuona giornata', '2016-05-18 08:44:00', 1114, -27, 227),
(315, 1195, 'click day aggiornamento', 'Mi sono iscritto oggi al click day aspetto per il 19 maggio aggiornamenti...rimango in attesa buona giornata', '2016-05-18 17:27:00', 89, -3, -1),
(316, 1196, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buonasera Vanessa \r\nMi sono iscritta, ora il prossimo step è firmare il contratto e caricare il contratto firmato? \r\nGrazie ', '2016-05-18 17:29:00', 4, -23, 227),
(318, 1207, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Grazie mille! Attendiamo!!\r\nA presto\r\nGiovanna', '2016-05-18 20:29:00', 4, -23, 227),
(320, 127, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno. Devo inviare il contratto firmato?\r\nE lo screenshot da caricare è quello del primo giorno?\r\nGrazie', '2016-05-19 06:42:00', 4, -23, 227),
(321, 1130, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'ciao dove posso vedere la data del click day?', '2016-05-19 06:54:00', 4, -23, 227),
(322, 859, 'Help', 'Salve, per partecipare al Click Day devo registrarmi al sito dell''Inail? Come faccio? Grazie', '2016-05-19 06:55:00', 89, -3, -1),
(323, 1172, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Va bene; le notizie arriveranno via mail o devo consultare la mia area personale?', '2016-05-19 07:55:00', 4, -23, 227),
(324, 89, 'RE: click day aggiornamento', 'Va bene, \r\nGrazie e attenda nostre info.\r\n\r\nCordiali saluti', '2016-05-19 08:00:00', 1195, -24, 315),
(325, 89, 'RE: Help', 'No, nessuna iscrizione a nessun sito:\r\n\r\nQuando ci comunicheranno la data, vi manderemo il tutto e anche il link della pagina inial ( senza nessuna iscrizione).\r\n\r\ncordiali saluti', '2016-05-19 08:01:00', 859, -24, 322),
(326, 4, 'RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno Valentina!\r\nIl contratto può inviarlo anche più avanti, prima della data del Click Day, che le comunicheremo nei prossimi giorni (direi tra oggi e domani). \r\nInoltre, riceverà un video tutorial via mail in cui le spiegheremo la procedure per il click.\r\nQuindi, ora non deve fare altro che aspettare nostre notizie ;)\r\nGrazie!', '2016-05-19 08:25:00', 1196, -27, 227),
(327, 1174, 'informazioni', 'Vorrei sapere quando mi verrà comunicato il giorno e l''ora per il click day e il sito per effettuare l''operazione\r\ngrazie', '2016-05-19 08:26:00', 89, -3, -1),
(328, 4, 'RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno Elena,\r\npuò inviare il contratto firmato prima della data del Click Day, che le comunicheremo tra oggi e domani.\r\nInoltre, nei prossimi giorni riceverà via email un video tutorial nel quale le spiegheremo la procedura per fare il click dove troverà anche la spiegazione del caricamento screenshot.\r\nBuona giornata!', '2016-05-19 08:28:00', 127, -27, 227),
(329, 89, 'RE: informazioni', 'Appena INAIL ci comunica il tutto, diciamo la prossima settimana dovremmo comunciare la data , e le informazioni.\r\nTutto tramite mail.', '2016-05-19 08:36:00', 1174, -24, 327),
(330, 1219, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Ciao grazie ho appena messo "Mi piace " alla pagina', '2016-05-19 08:38:00', 4, -23, 227),
(331, 587, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno\r\na tutt''oggi io non ho ancora ricevuto nulla, nè il video con le istruzioni, di cui si parla nel suo messaggio nè la data esatta, non credo di avere problemi di ricezione perchè mi arrivano innumerevoli mail al giorno, c''è qualcosa che devo fare?\r\nGrazie infinite\r\nLicia', '2016-05-19 09:14:00', 4, -23, 227),
(332, 299, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno, ho notato solo ora il contratto in fondo alla pagina. Devo firmarlo e caricarlo immediatamente?', '2016-05-19 10:09:00', 4, -23, 227),
(333, 1228, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'non ho facebook\r\n', '2016-05-19 10:15:00', 4, -23, 227),
(334, 728, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'grazie!!! Per quanto riguarda le informazioni e come fare le mandate sulla posta personale oppure qui dentro??\r\n', '2016-05-19 10:22:00', 4, -23, 227),
(335, 1169, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno, non so se è già stato inviato ma io non ho ancora ricevuto nessun tutorial che spieghi quello che si deve fare.\r\n\r\nSaluti\r\nTania', '2016-05-19 11:13:00', 4, -23, 227),
