(354, 6, 'E'' uscita la data del Click Day!!!', 'Ciao!\r\nL’INAIL ha fissato la data e l’ora del Click Day per il giorno giovedì 26 maggio 2016 alle ore 16.00 esatte. La procedura però per voi cliccatori si attiverà prima, sarà quindi richiesta la vostra presenza davanti al vostro PC per le ore 15.30.\r\n\r\nSarà nostra cura, nei prossimi giorni, inviarvi un  video tutorial molto semplice che vi illustrerà la procedura di invio del codice progetto. Tale codice progetto vi verrà inviato nei prossimi giorni via email.\r\n\r\nSeguiranno altre indicazioni!\r\n\r\nKEEP CALM AND CLICK FAST!\r\n\r\nLo Staff Click Day', '2016-05-19 14:09:00', -1, -15, -1),
(355, 1133, 'Richiesta informazioni', 'Buongiorno, volevo sapere se in attesa del clickday devo inoltrarvi il contratto (firmato da me) che è presente nella mia pagina personale, grazie e cordiali saluti', '2016-05-19 14:13:00', 89, -3, -1),
(356, 1200, 'RE: E'' uscita la data del Click Day!!!', 'Grazie, attendo allora il codice e soprattutto il video, per esercitarmi e vedere come funziona l''invio.', '2016-05-19 14:15:00', 6, -23, 354),
(357, 1055, 'RE: E'' uscita la data del Click Day!!!', 'Ok.....attendo il video tutorial allora.Grazie', '2016-05-19 14:16:00', 6, -23, 354),
(358, 793, 'RE: E'' uscita la data del Click Day!!!', 'Salve, io purtroppo non ci sarò. Quindi, se  volete eventualmente cancellare o disattivare il mio account, procedete pure.\r\nSaluti, Diego.', '2016-05-19 14:16:00', 6, -23, 354),
(359, 89, 'Conferma Iscirzione', ' francesca.sinfonia92@gmail.com\r\n\r\nA QUESTA MAIL NON HA RICEVUTO NIENTE?\r\nIL 13 MAGGIO QUANDO SI E'' ISCRITTO DEVE AVER RICEVUTO UNA COMUNICAZIONE...', '2016-05-19 14:17:00', 923, -24, -1),
(360, 622, 'RE: E'' uscita la data del Click Day!!!', 'Grazie, fatemi sapere se va bene l''invio dell''ultima pagina del contratto firmato.\r\n Buona serata Lucia', '2016-05-19 14:18:00', 6, -23, 354),
