(368, 1266, 'Documento identità', 'Nel contratto è stato inserito due volte il mio codice fiscale, una volta difianco alla voce "Codice Fiscale". Mentre la seconda volta difianco alla voce "N° documento identità". COme mai? Io non ho inserito il mio numero di carta d''identità', '2016-05-19 14:55:00', 154, -3, -1),
(369, 976, 'RE: E'' uscita la data del Click Day!!!', 'Confermo la ricezione della comunicazione e la mia partecipazione al ClickDay per il giorno 26 maggio.\r\nUn cordiale saluto, \r\nFranca Castelli', '2016-05-19 14:57:00', 6, -23, 354),
(370, 677, 'RE: E'' uscita la data del Click Day!!!', 'okkkkkk', '2016-05-19 15:13:00', 6, -23, 354),
