(384, 688, 'RE: E'' uscita la data del Click Day!!!', 'Buongiorno, chiedo info in merito al contratto. Ho visto che sono state inserite le date, possiamo compilarlo e rimandarlo via email?\r\nGrazie \r\nSaluti\r\nClaudia Amadori', '2016-05-20 08:37:00', 6, -23, 354),
(385, 4, 'RE: Documento identità', 'Può cancellare tranquillamente il codice fiscale ripetuto la seconda volta a mano e correggere prima di inviare. \r\nSe non dovesse riuscirci, mi dica qualcosa che lo faccio sistemare ai nostri tecnici il prima possibile, grazie', '2016-05-20 09:39:00', 1266, -27, 368),
