(388, 1371, 'Residenza errata', 'Buongiorno.\r\nMi sono appena iscritta e sto leggendo il contratto. L''indirizzo di residenza però non è corretto. Come posso modificarlo?\r\nGrazie.\r\nSaluti,\r\nSara Marongiu', '2016-05-20 09:44:00', 162, -3, -1),
