(392, 88, 'RE: contratto', 'Salve, ce lo inoltri prima del click day.\r\n\r\nLa ringrazio.\r\n\r\nBuona giornata', '2016-05-20 09:56:00', 358, -24, 389),
(393, 4, 'RE: Residenza errata', 'Buongiorno Sara,\r\npuò modificarlo tranquillamente a mano, tanto deve stamparlo per firmarlo e rinviarlo,\r\ngrazie', '2016-05-20 10:02:00', 1371, -27, 388),
(394, 1387, 'info', 'volevo sapere la data del click day e il compenso in caso di esito favorevole ', '2016-05-20 10:14:00', 89, -3, -1),
