(399, 736, 'RE: RE: RE: RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno ho caricato il contratto firmato, desideravo sapere perchè c''è scritto che la prestazione terminerà alle 16.05 quando in realtà inizia alle 16 e durerà sicuramente più di 5 minuti (anche se dobbiamo essere operativi già dalle 15.30).\r\nLa ringrazio. Buona giornata', '2016-05-20 10:30:00', 3, -23, 227),
(400, 1396, 'salve', 'salve, è la prima volta per me. vorrei sapere come funziona. Mi mandate voi 1 codice di un azienda? ci sono dei trucchi o delle dritte da seguire (ad esempio prepararsi il codice scritto nella giusta forma da fare copia incolla)? grazie in anticipio, marco', '2016-05-20 10:43:00', -1, -1, -1),
(401, 4, 'RE: salve', 'Buongiorno Marco,\r\ntrova tutte le informazioni sul sito http://clickdayats.it/\r\nLe manderemo noi il codice da inviare e, una volta iscritto, riceverà un video tutorial con la spiegazione della procedura del click ', '2016-05-20 10:48:00', 1396, -27, 400),
(402, 89, 'RE: info', '26/05/2016 ORE 15.30\r\n€ 300.00 NETTI', '2016-05-20 10:50:00', 1387, -24, 394),
(406, 808, 'Info', 'Salve volevo sapere come faccio a compilare il contratto che mi avete inviato?grazie', '2016-05-20 12:05:00', 88, -3, -1),
(407, 88, 'RE: Info', 'Salve,\r\n\r\nlo deve stampare, firmarlo e ritornarcelo.\r\n\r\nSaluti', '2016-05-20 12:08:00', 808, -24, 406),
(408, 998, 'RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Buongiorno,\r\nio ho P.IVA e ho letto nella domanda nr. 7 che dovrò emettere in caso una regolare fattura. Non ho capitò, però, se devo comunque scaricare e firmare il contratto allegato oppure se dovete inviarmene un altro.\r\n\r\nIn attesa di una vs. gradita risposta, porgo distinti saluti.\r\n\r\nBarbara Antonello', '2016-05-20 12:50:00', 4, -23, 227),
(410, 563, 'RE: E'' uscita la data del Click Day!!!', 'Perfetto, ci sarò.\r\nBuona giornata.\r\nMario', '2016-05-20 14:06:00', 6, -23, 354),
