(419, 1506, 'Contratto firmato', 'Salve a tutti,\r\n\r\nVorrei avere una copia controfirmata del contratto cosí poi provvederó anche io ad inviarvene una.\r\nResto in attesa anche di eventuali ulteriori informazioni sulla procedura e del codice da inserire.\r\nCordiali saluti\r\nDott. M. Rabie', '2016-05-21 09:48:00', 89, -3, -1),
