(434, 1200, 'RE: RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Grazie mille! Vorrei fare qualche domanda:\r\n\r\n- Il giorno del ClickDay sarà consentito il copia-incolla del codice? Non bisogna scriverlo manualmente, vero?\r\n- Ho letto che ci saranno anche delle domande nel modulo, per bloccare i bot, sapete che tipo di domande saranno?\r\n- Lo screenshot dell''avvenuto click si può fare con calma appena mandato il click? Bisogna far vedere anche l''ora esatta?\r\n\r\nGrazie mille', '2016-05-22 13:54:00', 6, -23, 227),
(435, 5, 'AGGIORNAMENTI DA CLICK DAY', 'Ciao!\r\nDomani, lunedì 23 maggio 2016, ti invieremo il codice progetto via mail e altre informazioni utili!\r\nNel caso non lo ricevessi comunicacelo immediatamente il giorno successivo scrivendoci dalla tua area personale di http://clickdayats.it/ oppure scrivendo a info@clickdayats.it  e provvederemo ad inoltrartelo nuovamente!\r\n\r\nRicorda che il Click Day è fissato per il giorno giovedì 26 maggio alle ore 16.00 in punto ma la tua presenza davanti al tuo PC è richiesta per le 15,30 in modo da trovarti pronto!\r\n\r\nQui ora trovi il conto alla rovescia al Click Day: http://clickdayats.it/ !\r\n\r\nKEEP CALM AND CLICK FAST!\r\n\r\nLo Staff di Click Day\r\n', '2016-05-22 16:53:00', -1, -15, -1),
