(594, 6, 'RE: RE: Cosa dovrai fare ora che ti sei iscritto a Click Day ?', 'Il contratto dovrà inviarlo solo nel caso in cui il suo click risulterà vincente, ovvero se il progetto da lei inviato otterrà l’ammissibilità al finanziamento dell’INAIL, \r\ngrazie', '2016-05-24 10:01:00', 1484, -27, 227),
(595, 1786, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Buongiorno, io ho appena effettuato l''iscrizione e ho letto i messaggi in memoria. Ovviamente non ho ricevuto il codice da incollare nè tanto meno il nome dell''azienda. Che devo fare? aspettare che arrivi o lo invia lei?\r\nGrazie intanto, buona giornata', '2016-05-24 10:02:00', 5, -23, 435),
