(597, 1742, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Buongiorno, ad oggi 24/5 non ho ancora ricevuto il codice progetto via mail. Resto in attesa di vostre indicazioni.\r\nLuca Tedesco', '2016-05-24 10:06:00', 5, -23, 435),
(598, 730, 'info', 'Salve lo scrivo anche qua,avendo già lasciato una email tramite la mia posta elettronica.Vedendo il tutorial avrei un problema...Non avendo office originale,di solito uso openoffice.Ho fatto una prova del salvataggio dello screenshot ma con openoffice ho diversi formati di salvataggio ma non quelli richiesti.Come posso risolvere il problema?', '2016-05-24 10:06:00', 89, -3, -1),
(599, 730, 'info', 'Salve,ho appena fatto qualche ricerca e se salvo l''immagine trasferendola su paint di windows ho la possibilità di salvare in png.Vi risulta anche a voi?è una pratica accettata?\r\nancora grazie e scusate per il disturbo.', '2016-05-24 10:16:00', 89, -3, -1),
(600, 235, 'Contratto', 'Salve volevo sapere se il contratto va firmato e caricato nella propria area personale.', '2016-05-24 10:17:00', 154, -3, -1),
(601, 86, 'RE: domanda', 'quanti codici dovremo inviare? io non ho Word, va bene Google drive?\r\n\r\nrisposta:\r\n- un solo codice\r\n- word non serve\r\n- google chrome è consigliato: ottimo.\r\n\r\nforza Manuel,\r\ngiovedì è vicino!', '2016-05-24 10:18:00', 1719, -24, 546),
(602, 89, 'RE: info', 'PUO'' FARE UNA FOTO DAL CELLULARE ( LEGGIBILE) E INVIARE QUELLA SEMPRE TRAMITE IL SITO.\r\nLE FOTO SI SALVANO SEMPRE IN JPG\r\n\r\nIN ALTERNATIVA PUò FARE COME HA DETTO LEI.. \r\nl''IMPORTANTE CHE SIA LEGGIBILE E IN UNO DEI DUE FORMATI.\r\n\r\nSALUTI', '2016-05-24 10:19:00', 730, -24, 599),
(603, 1153, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Salve, ma il contratto da me firmato devo inviarvelo giovedì o anche prima? Cordiali saluti', '2016-05-24 10:21:00', 5, -23, 435),
(604, 1153, 'Contratto', 'Salve, ma il contratto da me  firmato devo inviarvelo giovedì dopo aver ultimato il tutto o anche prima? Cordiali saluti', '2016-05-24 10:23:00', 89, -3, -1),
(605, 6, 'RE: Contratto', 'Buongiorno Lorenzo,\r\ndovrà inviare il contratto solo se il suo click risulterà vincente, ovvero se il progetto da lei inviato otterrà l’ammissibilità al finanziamento dell’INAIL, \r\ngrazie', '2016-05-24 10:26:00', 235, -27, 600),
(606, 161, 'RE: codice progetto', 'Non le è stato ancora assegnato, nel pomeriggio dovrebbe arrivarle.\r\nControlli anche nello spam.', '2016-05-24 10:26:00', 1743, -24, 556),
(607, 89, 'RE: Contratto', 'lo puo allegare quando vuole..\r\n\r\ncordiali saluti', '2016-05-24 10:28:00', 1153, -24, 604),
(608, 161, 'RE: DUBBI', 'nel tutorial, direi che il pc era collegato ad un secondo schermo ecco perchè lo stamp ha dato sue schermate affiancate.\r\nCorrettamente a noi deve inviare solo quella dell''inail con la schermata di risultato dell''invio.\r\nHo riprovato la procedura, e dopo aver incollato lo ''stamp'' (che equivale al comando copia) sulla pagina word, col tasto destro sull''immagine mi dà l''opzione di salvarlo come immagine.\r\nChiaramente può usare anche paint o altri software basta che l''output sia un jpg o png leggibile.\r\nPotrebbe anche fare la foto col cellulare e scarica il jpg dal cellulare.\r\nSpero di essere stato chiaro.\r\nBuon lavoro.\r\nMirco', '2016-05-24 10:32:00', 1498, -24, 561),
(609, 161, 'RE: CODICE PROGETTO', 'Ho verificato, non le è ancora stato assegnato.\r\nOggi pomeriggio dovrebbero inviarlo.\r\nControlli nel caso anche nello spam\r\nSaluti\r\nMirco', '2016-05-24 10:34:00', 1748, -24, 582),
(610, 161, 'RE: Codice progetto', 'ho verificato, non le è stato ancora assegnato il progetto, oggi pomeriggio dovrebbe arrivarle la mail col codice.\r\nControlli anche nello spam.\r\nSaluti\r\nMirco', '2016-05-24 10:36:00', 1783, -24, 591),
(611, 1734, 'RE: VIDEO TUTORIAL', 'Dove trovo il link dei codici progetto da copiare e il link dell'' inail per l''invio dei codici?', '2016-05-24 10:37:00', 5, -23, 554),
(612, 730, 'RE: RE: info', 'ok infatti farò con paint...ah un''altra cosa...vedevo che c''è da scaricare il contratto,firmarlo e poi ricaricarlo firmato nel sito....questa operazione va fatta in caso di click veloce e riscuotibile oppure in ogni caso?', '2016-05-24 10:39:00', 89, -22, 599),
(613, 1153, 'click day', 'mi scusi, poc''anzi stavo facendo le prove, ma è possibile che nell''incollare e salvare lo screnshot su word e poi passarlo in immagini jpg non mi compaia in word questo formato? posso salvarlo solo in word?', '2016-05-24 10:48:00', 89, -3, -1),
(614, 1731, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Salve, non ho ricevuto il codice progetto, dovrei anche caricare il contratto firmato ma quando provo a scaricare mi apre una pagina con un messaggio di errore. Cosa posso fare?\r\nGrazie', '2016-05-24 10:53:00', 5, -23, 435),
(616, 89, 'RE: click day', 'lo salvi con paint.. li lo salva gia in JPG', '2016-05-24 10:54:00', 1153, -24, 613),
