(618, 5, 'VIDEO TUTORIAL', 'Ciao! Ecco il nostro semplice video tutorial https://vimeo.com/167394771/71556e3518 che ti spiega passo dopo passo la procedura di invio del Codice progetto a te assegnato. Troverai anche qualche consiglio per fare il click più veloce! Trovi il link al tutorial video anche nel menu della tua area personale di clickdayats.it , nella colonna di sinistra, fra “Modifica dati personali” e “Logout”. Ricordiamo che è assolutamente vietato utilizzare sistemi di invio automatizzati del Codice Progetto, dovrai essere fisicamente tu ad inviarlo dal tuo computer! KEEP CALM AND CLICK FAST!', '2016-05-24 11:01:00', 1725, -27, -1),
