(623, 6, 'RE: mail', 'Buongiorno Giovanni, a noi risulta che ha ricevuto la mail di conferma.\r\nProvi per favore a controllare nella spam.\r\nSe ancora non dovesse trovarla, mi scriva nuovamente,\r\ngrazie', '2016-05-24 12:28:00', 1762, -27, 621),
(624, 86, 'RE: Codice progetto', 'Ciao Mirco,\r\nil codice ti verrà inviato nelle prossime 24 ore.\r\nil contratto nei tuoi confronti è già valido.\r\nper firmarlo e caricarlo non c''è però fretta, difatti diventerà necessario (speriamo) solo in caso di tua vittoria: per poter procedere all''eventuale pagamento nei tuoi confronti.\r\nciao!', '2016-05-24 12:36:00', 1812, -24, 622),
