(654, 1170, 'RE: VIDEO TUTORIAL', 'Buongiorno,\r\nHo seguito attentamente la procedura è ho qualche domanda da porre. Sfortunatamente in questi giorni (la sfortuna) il mio computer è andato in riparazione per diversi problemi perciò la mia intenzione è quella di utilizzare il PC ella biblioteca del mio comune. In questo caso però non so se sarà possibile fare la deselezione "proteggi te e te stesso" per chrome. Non so nemmeno se c''è la possibilità di collegare una propria rete e non quella del wifi. Volevo chiedere se eventualmente il non poter fare queste operazioni può compromettere l''attività.  Chiedo cortesemente se la risposta può arrivare per mail per evitare di continuare a dover accedere a questa area personale e prendere subito atto della risposta.\r\nLa ringrazio anticipatamente in attesa di una risposta. Porgo cordiali saluti.\r\nSimona Marini', '2016-05-24 14:00:00', 5, -23, 554),
