(667, 700, 'chiarimenti sul video', 'Buonasera, vorrei un chiarimento, quando nel video si illustra come fare lo Screenshot da inviare, mi sembra che la schermata dell''INAIL dove indica che l''operazione è avvenuta correttamente è una, nell''esempio indicato nel video ne vedo due, di quale si tratta? Grazie', '2016-05-24 14:53:00', 89, -3, -1),
