(672, 1850, 'Codice da riportare', 'Premettendo che mi sono iscritta oggi, non mi è ancora arrivata la vostra mail con il codice da riportare nel ClickDay, che mi è parso di capire sarebbe dovuto arrivare assieme alla prima mail di conferma della registrazione.\r\nGrazie anticipatamente', '2016-05-24 15:04:00', 89, -3, -1),
