(911, 6, 'RE: Contratto ', 'Buongiorno Alex,\r\ndovrà inviare il contratto solo se il suo click risulterà vincente, ovvero se il progetto da lei inviato otterrà l’ammissibilità al finanziamento dell’INAIL, grazie', '2016-05-25 08:44:00', 1289, -27, 841),
