(916, 1502, 'RE: VIDEO TUTORIAL', 'Buongiorno, ho guardato il video tutorial e mi è sorto un dubbio circa lo screenshot della schermata finale relativa all''operazione.  Dispongo di un programma apposito che salva la schermata del pc o parti di essa, salvando l''immagine in formato png. E'' necessario copiarla su un file Word come descritto nel video o posso inviare direttamente quella salvata dal programma? Inoltre nel video compaiono due schermate nella fase di copiatura su Word, quale sarebbe la seconda? Infine, se non dovessi visualizzare l''orario relativo all''operazione vorrebbe dire che non sono stata tra i più veloci e quindi sarei già esclusa dalla graduatoria? Grazie. ', '2016-05-25 09:06:00', 5, -23, 554),
