(919, 1946, 'RE: AGGIORNAMENTI DA CLICK DAY_mancata ricezione codice progetto', 'Buongiorno,\r\nmi sono registrata poco fa ed ho completato la procedura di attivazione del profilo.\r\nVi segnalo che non ho ricevuto il codice progetto.\r\nRiuscite gentilmente ad inviarmelo?\r\nGrazie mille,\r\nNathalie', '2016-05-25 09:14:00', 5, -23, 435),
