(970, 1745, 'Problemi nel caricamento contratto', 'Buongiorno sig. Faletti,\r\nle comunico che sto avendo difficoltà a caricare il contratto firmato nella mia area personale. \r\nInspiegabilmente riesco a caricare il contratto vuoto (scaricato ma non firmato), le singole pagine del contratto (diviso in pagine singole tramite programma apposito), ma non il contratto intero con la mia firma e la data.\r\nResto in attesa di istruzioni, al momento ho caricato la singola pagina n°3 del contratto (con firma e data).\r\nMonica Ferraro', '2016-05-25 12:44:00', 5, -23, 676),
