(1003, 1990, 'RE: VIDEO TUTORIAL', 'Buongiorno,\r\n\r\nho appena ricevuto il codice progetto. \r\n\r\nSolo due domande:\r\n1. il contratto firmato posso inserirlo nella mia area personale anche in un secondo momento (prima o dopo la procedura delle 16?)\r\n2. il tempo di inserimento dello sceenshot non viene calcolato nella tempistica di inserimento codice, giusto?\r\n\r\nGrazie.\r\nCordiali saluti.', '2016-05-25 13:16:00', 5, -23, 988),
(1004, 89, 'RE: informazioni', 'E'' la foto della schermata del pc... \r\nnel tutorial spiega come fare....', '2016-05-25 13:16:00', 1051, -24, 999),
(1005, 1998, 'RICHIESTA INFO', 'BUON POMERIGGIO, SOLO STASERA POTRO'' VEDERE IL TUTORIAL QUINDI NE APPROFITTO PER CHIEDERVI ORA DUE INFO.\r\nHO RICEVUTO SOLO UN CODICE PROGETTO VIA MAIL, E'' CORRETTO?\r\nIL MIO CODICE PROGETTO RIPORTA IL CARATTERE "-" ALL''INIZIO, DEVO COPIARE ANCHE QUELLO OPPURE PARTO DAL CARATTERE SUCCESSIVO, IL "4"?\r\nATTENDO GRAZIE.', '2016-05-25 13:17:00', 88, -3, -1),
(1006, 566, 'RE: VIDEO TUTORIAL', 'Salve,\r\n\r\nMi potrebbe indicare le migliori caratteristiche di un notebook per effettuare in modo efficace il clikday!?\r\n\r\nGrazie', '2016-05-25 13:24:00', 5, -23, 554),
