(1481, 522, 'richiesta informazioni', 'Sono Nicola Iovine, sono in attesa che si carichi la pagina del INAIL per inserire il codice prodotto. Stavo vedendo che nella mia area personale, dove si dovrà inserire lo screenshot della pagina alla fine dell''operazione, al di sotto c''è la possibilità di scarica il contratto sottoscritto con me come cliccatore, e poi c''è anche la sezione dove poter caricare lo stersso contratto firmato. la mia domanda quindi è.... ma posso partecipare lo stesso anche se non ho inoltrato la copia del contratto firmata? anche perche non avevo ricevuto mai vostre comunicazioni in merito a dover firmare il contratto scaricato e reinviarlo firmato! \r\nAttendo vostre notizie.\r\nGrazie e distinti saluti.\r\n\r\nNicola Iovine', '2016-05-26 13:36:00', 88, -3, -1),
(1483, 6, 'RE: Invio cattura screenshot', 'Il contratto può inviarlo successivamente, se il suo click risulterà vincente ovvero se il progetto da lei inviato otterrà l’ammissibilità al finanziamento dell’INAIL.\r\nPer quanto riguarda l''invio dello screenshot troverà uno spazio dedicato all''invio all''interno della sua area personale\r\ngrazie', '2016-05-26 13:37:00', 1553, -27, 1474),
(1484, 88, 'RE: richiesta informazioni', 'Sì Nicola, senza problemi.\r\n\r\nBuona fortuna', '2016-05-26 13:37:00', 522, -24, 1481),
