(1549, 321, 'codice identificativo', 'provato a inserire un sacco di volte il codice piu quello che richiedono loro e a fare invia ma niente da fare , mi rimandava sempre al codice identificativo senza rilasciarmi la ricevuta di presa in carico.', '2016-05-26 14:08:00', 88, -3, -1),
