(1557, 448, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'Ho constato che il video tutorial aveva informazioni sbagliate perchè per far comparire la pagina dove mettere il codice non ho dovuto refreshare la pagina ma bensì cliccare un link sulla pagina ', '2016-05-26 14:09:00', 5, -23, 1453),
