(1560, 859, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'E'' stata un impresa eseguire l''operazione! Dopo aver cliccato su invio la pagina è rimasta a caricare tanto, fino che l''operazione è stata annullata!', '2016-05-26 14:10:00', 5, -23, 1453),
(1561, 1188, 'codice inviato ma pagina temporaneamente bloccata', 'Dopo aver inserito il codice e il testo tra parentesi e premuto invia la pagina è rimasta molto tempo senza dare risposta, motivo per cui ho ripremuto più volte invia e alla fine ho ricevuto la schermata ma senza orario, è normale o l''aver inviato più volte mi ha impedito di visualizzare l''orario?', '2016-05-26 14:10:00', 89, -3, -1),
