(1564, 1408, 'informazione', 'Salve dopo aver inserito il codice mi si è presentata la schermata che mi dice "codice identificativo salvato", e non la schermata con l''orario. Io vi invio comunque lo screenshoot, anche se l''ho scattato successivamente, poiché attendevo la schermata presente nel video tutorial.', '2016-05-26 14:10:00', 86, -3, -1),
