(1566, 1650, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'Sono stato tratto in inganno dal campo obbligatorio da inserire sotto; pensavo che non me lo accettasse e quindi ho inserito il link diverse volte; non sapevo se dovevo copiare e incollare anche la stringa di sotto; comunque non credo di essere passato', '2016-05-26 14:10:00', 5, -23, 1453),
