(1568, 64, 'Nessun orario sullo screen', 'ciao,\r\nho seguito tutti i passaggi del tutorial che mi avete segnato. Ho letto tutte le vostre mail e.........alla fine la screen e quella che vedete sotto. Ho provato due volte a inserire il codice pensando di essere in errore, ma anche mio fratello ha avuto lo stesso problema (siamo in due luoghi diversi). Non so se e come possiate risalire a chi l''ha fatta. \r\nA presto,\r\nGiuseppina', '2016-05-26 14:10:00', 86, -3, -1),
(1569, 711, 'invio codice', 'Buongiorno, ho eseguito l''inserimento del codice nella pagina inali, solo che dopo aver inviato non mi è comparsa la schermata come nel tutorial col tempo impiegato per l''invio, ma come ho inviato con lo screenshot, mi diceva che il codice l''ho inserito e di tornare indietro all''inserimento. E'' normale?', '2016-05-26 14:10:00', 88, -3, -1),
(1570, 817, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'Salve io ho fatto tutto come da tutorial nel video ma vedendo appunto una scritta totalmente diversa rispetto al video del codice inviato,l ho rinviato dandomi sempre quella schermata che ho caricato,e corretto quindi il funzionamento che ho eseguito?', '2016-05-26 14:10:00', 5, -23, 1453),
