(1573, 522, 'richiesta info', 'ho inserito il codice...più di una volta perchè mi esce fuori dalla stessa pagina....la dicitura\r\nCodice identificativo salvato\r\n\r\nTorna all''inserimento del codice identificativo\r\n\r\ncosa devo fare????\r\nda dove prendo la pagina per effettuare lo screenshot?', '2016-05-26 14:11:00', 88, -3, -1),
