(1576, 1921, 'Non avviene la procedura come da tutorial', 'Ho provato a fare come da tutorial e procedura, ma l''unica risposta che ottengo dal sito dell''iINAIL è\r\n"INAIL AVVISO PUBBLICO QUADRO 2015 INCENTIVI ALLE IMPRESE PER LA REALIZZAZIONE DI INTERVENTI IN MATERIA DI SALUTE E SICUREZZA SUL LAVORO art. 11 comma 5 D.Lgs 81/2008 s.m.i. SPORTELLO INFORMATICO PER L''INVIO DELLA DOMANDA ON LINE Codice identificativo salvato Torna all''inserimento del codice identificativo" \r\n\r\nNon mi appare la schermata finale coi secondi dopo aver inserito il codice del progetto.', '2016-05-26 14:11:00', 86, -3, -1),
