(1581, 1058, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'Ciao Alessandro,\r\n\r\nho appena effettuato il click.\r\nC''è una cosa che non mi torna tanto, ho dovuto inserire il codice varie volte, perchè non mi dava la schermata di conferma. Spero non sia un problema, alle 16:00 precise il portale ha iniziato a funzionare stranamente, non aggiornandomi più la pagina dopo aver cliccato sul link.\r\n\r\nIn ogni caso, è stata una bella esperienza e spero che l''azienda per la quale ho sottomesso il codice ottenga il finanziamento.\r\n\r\nDistinti saluti & cross fingers,\r\nGiovanni Baldasseroni', '2016-05-26 14:12:00', 5, -23, 1453),
(1582, 1404, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'HO FATTO TUTTA LA PROCEDURA MA INVECE DELLA SCHERMATA COME DAL VIDEO TUTORIAL MI E'' APPARSA LA SCRITTA "CODICE IDENTIFICATIVO SALVATO" dopo manco 3 secondi (lo screen shot lo fatto dopo) ', '2016-05-26 14:12:00', 5, -23, 1453),
(1583, 1940, 'richiesta spiegazioni', 'Salve, chiedo scusa,\r\nho appena allegato lo screenshot, che significa il messaggio che compare? Non lo ricordo come opzione nel tutorial... \r\nSegnalo che nonostante avessi in memoria perfettamente la stringa , E SOLO QUELLA, il codice inserito non è risultato corretto per i primi due tentativi. Come mai? Qui funzionava tutto alla perfezione. \r\nGrazie dell''attenzione e dei chiarimenti.\r\nCordiali saluti.\r\n\r\nElena Cervi', '2016-05-26 14:12:00', 86, -3, -1),
(1584, 1329, 'non sono riuscita a fare il click day perchè mi e apparsa questa schermata', '\r\nLogo Inail\r\n\r\nINAIL AVVISO PUBBLICO QUADRO 2015\r\nINCENTIVI ALLE IMPRESE PER LA REALIZZAZIONE DI INTERVENTI\r\nIN MATERIA DI SALUTE E SICUREZZA SUL LAVORO\r\nart. 11 comma 5 D.Lgs 81/2008 s.m.i.\r\n\r\nSPORTELLO INFORMATICO PER L''INVIO DELLA DOMANDA ON LINE\r\n\r\n* Inserire il codice identificativo \r\n\r\n\r\n\r\n* Digitare solo il testo tra parentesi (R=J)  nel campo\r\n\r\n\r\n\r\n\r\nInvia* Campo obbligatorio.', '2016-05-26 14:12:00', 161, -3, -1),
