(1610, 1092, 'screenshot', 'buongiorno,\r\nho appena inviato l''immagine. quando avrò conferma che sia buona?\r\ndal video si vede che dopo l''inserimento del video e aver cliccato ok esce una finestra con l''orario mentre mi è uscito solo scritto codice identificativo corretto.\r\nattendo risposta.\r\ngrazie\r\n', '2016-05-26 14:15:00', 89, -3, -1),
(1611, 1045, '...', 'Sono dieci minuti che provo a mandarvi lo screenshot, sia in pdf che in openoffice.\r\nNon me lo carica', '2016-05-26 14:16:00', 88, -3, -1),
(1612, 1901, 'ClickDay problematica', 'Come si evince dallo screen il sito dell''Inail si è rifiutato di darmi la data di inserimento, l''ho fatto innumerevoli volte ma non ha mai funzionato. Sono su una linea senza filtri su porte, su un pc con installazione di OS fatta appositamente pulita e senza filtri di alcun genere tra cui AV o blocchi popup, ad e phishing. Io carico lo screen comunque ma non c''è modo per verificare il mio inserimento vero?', '2016-05-26 14:16:00', 157, -3, -1),
(1613, 622, 'inviato codice!!!', 'vorrei inviare copia dell''invio codice inail, dove posso allegare il documento?', '2016-05-26 14:16:00', 89, -3, -1),
(1614, 1480, 'FATEMI CAPIRE CHE SUCCEDE', 'COME POTETE VEDERE NEL MIO SCREENSHOT MI HA DATO ERRORE E NEMMENO IL TEMPO IN CUI L''HO INSERITO.ED ERA TUTTO GIUSTO.COM''E''POSSIBILE', '2016-05-26 14:16:00', 89, -3, -1),
(1615, 2166, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'ciao, ho inserito il codice ma diceva di non essere corretto ( non cancellando nemmeno una lettera o un +), potresti gentilmente spiegarmi il perchè? grazie mille', '2016-05-26 14:17:00', 5, -23, 1453),
(1616, 2018, 'invio codice', 'ho completato la procedura, ma la schermata successiva segnala solo che ho inviato il progetto non mi da nessuna tempistica..', '2016-05-26 14:17:00', 89, -3, -1),
(1617, 1733, 'clickday', 'ho fatto tutti i passaggi forse in un secondo ma il sito inail non mi ha mandato nessuna schermata da stampare o salvare con codice o orario\r\nViene fuori solo la frase "TORNA ALL''INSERIMENTO DEL CODICE IDENTIFICATIVO".\r\nHo ripetuto i passaggi almeno 5 volte ... sempre uguale\r\nCosa faccio?', '2016-05-26 14:17:00', 89, -3, -1),
(1618, 578, 'Click Day', 'Come vedete da screenshot mi dice codice identificativo salvato ma non fa vedere il tempo.....', '2016-05-26 14:17:00', 88, -3, -1),
(1619, 1166, 'non ho chiaro cosa sia successo', 'io ho caricato e mi ha mostrato che tutto era ok, dopo però non ho visto il msg mostrato dal video tutorial.... quindi ho rinviato il codice.... ma non ho salvato il screenshop.... insomma fammi sapere se il mio codice è cmq andato a buon fine oppure no. Ogni cliccatore ha un codice diverso o no?Grazie!! ! Elena', '2016-05-26 14:17:00', 89, -3, -1),
(1620, 1166, 'non ho chiaro cosa sia successo', 'io ho caricato e mi ha mostrato che tutto era ok, dopo però non ho visto il msg mostrato dal video tutorial.... quindi ho rinviato il codice.... ma non ho salvato il screenshop.... insomma fammi sapere se il mio codice è cmq andato a buon fine oppure no. Ogni cliccatore ha un codice diverso o no?Grazie!! ! Elena', '2016-05-26 14:17:00', 89, -3, -1),
(1621, 1114, 'sceenshot', 'screen caricato , ', '2016-05-26 14:17:00', 5, -23, 1116),
(1622, 700, 'info', 'Ho inserito ma mi dice solo codice identificativo salvato \r\nnon è andata a buon fine?', '2016-05-26 14:17:00', 89, -3, -1),
(1623, 1097, 'nessun timer', 'ho fatto lo screenshot della mia schermata ma non ho visualizzato nessun timer. come faccio a sapere quanto tempo ho impiegato?', '2016-05-26 14:18:00', -1, -1, -1),
(1624, 1039, 'Campo di verifica', 'Non mi prendeva l campo di verifica. Ho dovuto scriverlo per 3 volte prima che me lo accettasse. non sbagliavo a scriverlo perchè lo scrivevo sempre uguale e in maiuscolo. Non è giusto però cosi ...... Il campo era il seguente: (R=J) dovevo riportare solo la scritta all''interno della parentesi in maiuscolo. ', '2016-05-26 14:18:00', 89, -3, -1),
(1625, 1133, 'Screenshot', 'Ho inviato lo screenshot dell''inserimento ma non mi viene fuori nessun tempo, m dice solo codice identificativo salvato, è normale??? ', '2016-05-26 14:18:00', 89, -3, -1),
(1626, 915, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'Allego la pagina che mi è venuta fuori avendo provato più volte l''inserimento codice. Ho fatto TUTTO come spiegato sul tutorial, ma non mi è arrivata la schermata come specificato da video.', '2016-05-26 14:18:00', 5, -23, 1453),
(1627, 1114, 'screen caricato', 'ho caricato lo sceen aspetto vostra conferma', '2016-05-26 14:18:00', 1114, -21, 227),
(1628, 1355, 'screenshot', 'Gentile Direzione, \r\n\r\nsono riuscita a salvare lo screenshot, ma non essendo comparsa l''ora significa già che sono fuori dal contributo? Grazie, arrivederci.', '2016-05-26 14:18:00', 162, -3, -1),
(1629, 1868, 'invio screenshot', 'Buongiorno, ho caricato lo screenshot dell''invio del mio codice, ma non trovo un comando tipo "invia" per inviarvelo.\r\nE'' sufficiente caricarlo così e voi potete vederlo?\r\n\r\nGrazie\r\nEmanuela', '2016-05-26 14:19:00', 161, -3, -1),
(1630, 1300, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'ALLORA, A ME NON FA SALVARE IL FILE, LA PAGINA INAIL DOPO AVER MESSO CODICE MI DICE DI RITORNARE SEMPRE A RIMETTERE IL CODICE BAH. ', '2016-05-26 14:19:00', 5, -23, 1453),
(1631, 396, 'INVIO RICEVUTA', 'NON SI RIESCE A CARICARE LO SCREEN', '2016-05-26 14:20:00', 88, -3, -1),
(1632, 1484, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'Io ho seguito la procedura alla lettera, inserito il codice e R=J, inviato....è cmparsa la scritta: \r\nCodice identificativo salvato       \r\nPerò seguito dalla scritta da cliccare: Torna all''inserimento del codice identificativo\r\ne cliccando è stato ripetuto due/tre volte? Ho provato a copiare con STAMP  questa pagina nel mio spazio  scr...', '2016-05-26 14:20:00', 5, -23, 1453),
(1633, 999, 'Grazie', 'Salve,  volevo  ringraziarVi  di a vermi dato  questa p ossiblità,  è stato molto bello poter partecipare. \r\nIo adoro tutto questo.\r\nMi scuso ma nell''agitazione avevo  inserito anche la parentesi  XD\r\nMi dispiace tanto :(\r\nComunque grazie di questa possibilità e delle Vostre email,  era   spiegato  tutto molto bene.\r\nCordiali saluti.\r\n                                                                                                 Anna  Paggiola', '2016-05-26 14:20:00', 5, -23, 1453),
(1634, 1051, 'info', 'avete notizie se avverrà in serata o in altro giorno? e l''ora?', '2016-05-26 14:20:00', 89, -3, -1),
(1635, 1852, 'rettifico', 'Salve, lo screenshot sono riuscita a caricarlo, però non è la pagina che si vedeva dal tutorial.\r\n\r\nCome mai?', '2016-05-26 14:21:00', 86, -3, -1),
(1636, 533, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'la pagina inail continua a darmi codice identificativo salvato ma non mi lascia andare avanti', '2016-05-26 14:21:00', 5, -23, 1453),
(1637, 197, 'screen', 'ho usato lo strumento di cattura per fare lo screen, ho salvato in png  e caricato.', '2016-05-26 14:21:00', 160, -3, -1),
(1638, 1091, 'Ho partecipato al click seguendo la procedura indicata, non mi è uscito il tempo ', 'Ho partecipato al click seguendo la procedura indicata, ma non mi è uscito il tempo utilizzato\r\nPerché?', '2016-05-26 14:21:00', 89, -3, -1),
(1639, 1490, 'screenshot clickday 2016', 'Salve, non riesco ad allegare lo screenshot del bando. Come posso fare. Saluti\r\nCapotondo Cristina', '2016-05-26 14:22:00', 89, -3, -1),
(1640, 672, 'informazioni', 'Salve, dopo aver fatto il click, mi è comparsa la pagina dove diceva che avevano preso il codice, però poi, nella foga del momento, ho premuto il link "torna all''inserimento del codice" e l''ho dovuto rifare. Volevo sapere quale registrazione valesse prima (spero la prima), grazie.\r\nP.s. lo screenshot è della seconda volta che ho svolto la procedura', '2016-05-26 14:22:00', 89, -3, -1),
(1641, 1177, 'CODICE INVIATO -3403d85930a082c5703d65d4f0958807109d661456cd02d5fd87d0571a6a1088', 'vi confermo di aver inviatoil codice in oggetto alle 16.00 in punto', '2016-05-26 14:22:00', 5, -23, 1453),
(1642, 587, 'invio screenshot', 'mi scusi ho caricato lo screenshot come mi era stato indicato ma ora non so come procedere per inviarlo mi date qualche indicazione per favore''', '2016-05-26 14:22:00', 89, -3, -1),
(1643, 5, 'SCHERMATA FINALE DI INVIO', 'Ciao!\r\nSe nella schermata finale di presa in carico del codice progetto non vi è comparso il tempo, come spiegato nel tutorial video, significa che qualcuno ha inviato il codice più velocemente di voi. Solo le schermate che riportano il tempo di invio possono concorrere all’ottenimento del contributo dell’azienda e quindi al compenso relativo per il cliccatore! Seguiranno aggiornamenti non appena verranno pubblicati gli elenchi cronologici dell''INAIL entro una settimana!\r\nGrazie a tutti per aver partecipato!', '2016-05-26 14:22:00', -1, -15, -1),
(1644, 1755, 'SCREENSHOT', 'ho caricato la ricevuta d''invio. Va bene così?', '2016-05-26 14:22:00', 165, -3, -1),
(1645, 1903, 'Contratto', 'Buon pomeriggio,\r\ncodice inserito! Devo inviare la copia del contratto firmato, quanto tempo ho per farlo? Grazie ', '2016-05-26 14:22:00', 161, -3, -1),
(1647, 1568, 'Screenshoot', 'Salve, quale formato occore per lo screenshoot,\r\nnon riesco a caricarlo', '2016-05-26 14:23:00', 161, -3, -1),
(1648, 1155, 'info', 'vorrei informazioni visto che non riesco ad inserire screenshot. \r\ndistinti saluti ', '2016-05-26 14:23:00', 5, -23, 435),
(1649, 1482, 'Codice identificativo salvato', 'Salve, nonostante abbia seguito le istruzione del video non mi appare la conferma ma solo quel messaggio che ho messo in allegato, avrò provato una cinquantina di volte, cosa faccio? Oramai lascio perdere...', '2016-05-26 14:23:00', 162, -3, -1),
(1650, 161, 'RE: Non mi lascia caricare lo screenshot', 'può usare paint per incollarlo e salvarlo come immagine oppure usare il cellulare.\r\nSe il portale le ha dato un tempo allora è stato il più veloce, se invece solo codice identificativo salvato allora qualcuno è stato più veloce di lei.\r\nIn tal caso caricare lo screen è inutile.\r\nSe interessata la ricontatteremo l''anno prossimo per il nuovo clickday.\r\nSaluti \r\nMirco', '2016-05-26 14:23:00', 1566, -24, 1609),
(1651, 161, 'RE: Screenshoot', 'jpg o png', '2016-05-26 14:24:00', 1568, -24, 1647),
(1652, 1161, 'RE: SCHERMATA FINALE DI INVIO', 'D''accordo. Grazie mille comunque. ', '2016-05-26 14:24:00', 5, -23, 1643),
(1654, 6, 'RE: caricamento screenshot', 'Potrà inviarlo se il suo click sarà vincente, grazie', '2016-05-26 14:24:00', 1357, -27, 1545),
(1655, 161, 'RE: Contratto', 'in settimana', '2016-05-26 14:24:00', 1903, -24, 1645),
(1656, 250, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'Ma è normale che alle ore 16 in punto ho fatto refresh (con una linea 500Mb/100b) e il sito ha rallentato e ci ha messo ben 10 secondi a caricare? Sono basito, è incredibile come l''infrastruttura non sia adeguata a sopportare tutta l''utenza.', '2016-05-26 14:24:00', 5, -23, 1453),
(1657, 88, 'RE: Stamp ClickDay', 'Ha il tempo di invio?', '2016-05-26 14:24:00', 1045, -24, 1577),
(1658, 1153, 'Reclamo', 'Mi spiegate perchè nonostante tutta la mia buona procedura nell''attivazione, io abbia incollato non so più quante volte il codice senza che la cache cambiasse..e cliccando su invia?', '2016-05-26 14:24:00', 89, -3, -1),
(1659, 88, 'RE: ...', 'Ha il tempo di inserimento?', '2016-05-26 14:25:00', 1045, -24, 1611),
(1660, 88, 'RE: INVIO RICEVUTA', 'Ha il tempo di inserimento?', '2016-05-26 14:25:00', 396, -24, 1631),
(1661, 161, 'RE: PROBLEMA DI CONVERSIONE', 'tasto destro sulla immagine e ''salvare come immagine''.\r\nIl file di word non può essere convertito in jpg.\r\nNel caso può incollare lo screen in paint e salvarlo come jpg', '2016-05-26 14:25:00', 1164, -24, 1575),
(1662, 1357, 'RE: RE: caricamento screenshot', 'Speriamo Bene,\r\nSaluti', '2016-05-26 14:26:00', 6, -23, 1545),
(1663, 1051, 'RE: NON TI PREOCCUPARE SE ORA IN LINK ALLA PAGINA NON FUNZIONA', 'quando a che ora e in che giorno, io ho altro ora da fare no posso star qui vi ho anche telefonato date altre informazioni se ne avete', '2016-05-26 14:26:00', 5, -23, 1453),
(1664, 161, 'RE: Buongiorno', 'il più veloce. \r\nSe le ha dato il tempo allora è stata più veloce, se ha avuto la risposta ''codice identificativo salvato'' allora un altro cliccatore è stato più rapido.', '2016-05-26 14:26:00', 1567, -24, 1551),
(1665, 6, 'RE: schermata finale ', 'Se nella schermata finale di presa in carico del codice progetto non vi è comparso il tempo, come spiegato nel tutorial video, significa che qualcuno ha inviato il codice più velocemente di voi. Solo le schermate che riportano il tempo di invio possono concorrere all’ottenimento del contributo dell’azienda e quindi al compenso relativo per il cliccatore.\r\nGrazie', '2016-05-26 14:26:00', 1825, -27, 1562),
