(1680, 1153, 'Reclamo', 'la cache non cambiava e ha riportato sempre sulla prima...mi spiegate il motivo??', '2016-05-26 14:30:00', 89, -3, -1),
(1681, 1191, 'RE: SCHERMATA FINALE DI INVIO', 'Salve,\r\nquindi nel caso in cui non appare il tempo non è necessario inviare \r\nlo screenshot? Sto cercando invano di trovare il tasto invia ma non \r\nriesco....\r\nGrazie mille\r\nCordiali saluti\r\nLinda', '2016-05-26 14:31:00', 5, -23, 1643),
(1682, 654, 'Non ci ho capito molto', 'Buongiorno,\r\nho seguito tutti i passaggi ma quando ho messo il codice che mi avete mandato non è successo niente, non riesco a capire, la pagina di cui si parla nel tutorial non è apparsa, cedo di aver perso un occasione ma non capisco perché', '2016-05-26 14:31:00', 88, -3, -1),
