(1684, 1530, 'RE: SCHERMATA FINALE DI INVIO', 'Questo nel tutorial non era spiegato....  potevate dirci di aprire l''orologio del sistema in visualizzazione con  hh/mm/ss.  !!! \r\n\r\n', '2016-05-26 14:32:00', 5, -23, 1643),
(1685, 1028, 'RE: SCHERMATA FINALE DI INVIO', 'Buongiorno.\r\nA me è comparso il tempo, come specificato nel video tutorial. Ritengo, anche, di essere stato abbastanza veloce, seppur col cuore in gola.\r\nHo caricato già lo sreenshot nella mia area personale in formato JPEG; eventualmente ho salvato lo stesso sreenshot anche in formato PNG.\r\nRimango in trepidante attesa di conoscere l''esito del mio lavoro, ossia se mi posso aggiudicare il compenso pattuito. \r\nRingrazio. Saluti,\r\n\r\nDario Scarpa', '2016-05-26 14:32:00', 5, -23, 1643),
(1686, 255, 'RE: SCHERMATA FINALE DI INVIO', 'ho capito grazie ', '2016-05-26 14:33:00', 5, -23, 1643),
