(1690, 808, 'RE: SCHERMATA FINALE DI INVIO', 'Salve a me rispetto alla schermata del tutorial è stata diversa perché ho fatto la procedura con il cellulare ...nel tutorial mentre procedi ad inserire il codice progetto conta  il tempo mentre a me da tutto inizio non è risultato', '2016-05-26 14:34:00', 5, -23, 1643),
