(1695, 160, 'RE: screen', 'va benissimo gaiuz', '2016-05-26 14:37:00', 197, -24, 1637),
(1696, 522, 'Re:', 'mi sembra molto strano....ma proprio tanto strano!\r\ndopo anni e anni di utilizzo della tastiera ...non credo che incollare una stringa di un codice alfanumerico e scrivere un codice R=J in un altro campo e poi cliccare su invio ci vuole la scienza! ne tanto meno la velocità di Road runner! le velocità umane sono più o meno le stesse! che poi il sito INAIL ci metta del tempo per rispondere e aggiornare la pagina di risposta questo non dipende da nessuno! non giocate con la gente! vi prego! siete patetici!', '2016-05-26 14:38:00', 88, -3, -1),
(1697, 1406, 'RE: SCHERMATA FINALE DI INVIO', 'In ogni caso ho il report screenshot anche con l''orario internet del pc sarà mia cura verificare l''orario di arrivo del codice azienda a me assegnata.\r\nA presto,\r\nM.', '2016-05-26 14:38:00', 5, -23, 1643),
(1698, 89, 'RE: reclamo', 'il piu veloce lo ha inviato alle 16.00.06.187\r\nin sei secondi..\r\n2 minuti è un tempo alto..', '2016-05-26 14:38:00', 1153, -24, 1688),
(1699, 1836, 'screenshot', 'io non riesco a caricare lo screenshot come devo fare?\r\n', '2016-05-26 14:38:00', -1, -1, -1),
