(1703, 1153, 'reclamo', 'e poi la schermata INAIL si è aperta in ritardo, vale a dire alle 16.00 e non alle 15.55 \r\nun po'' di cose che non quadrano..ok?', '2016-05-26 14:40:00', 89, -3, -1),
(1704, 88, 'RE: Re:', 'Nicola, cosa sta dicendo? Ha caricato lo screenshot?', '2016-05-26 14:41:00', 522, -24, 1696),
