(1763, 735, 'RE: SCHERMATA FINALE DI INVIO', 'Io ho mandato tre volte il codice, ma sono riuscito a vedere solo la seconda e terza schermata. Infatti la prima volta (penso di aver impiegato meno di 5 secondi compresa la stringa di controllo) il sito Inail non ha dato risposta e ha girato come se stesse caricando per più di un minuto. Allora ho ricliccato Invio e ho avuto la schermata che ho allegato. Ma la prima in qualche modo è rintracciabile? Concorre?\r\n\r\nGrazie', '2016-05-26 23:03:00', 89, -3, -1),
(1764, 89, 'RE: reclamo', 'purtroppo la pagina non è gestita da noi. ma se cliccando non prendeva l''invio ci dovevano essere degli errori, che potrebbero essere stati anche un copia sbagliato.\r\nCi dispiace che lo abbia considerato una perdita di tempo. Molti sono riusciti a fare il procedimento. e saremmo stati felici che anche lei ci fosse riuscita. Purtoppo non è colpa nostra.', '2016-05-26 23:05:00', 1153, -24, 1703),
