(1775, 86, 'il giorno dopo', 'Il team 01PC stà raccogliendo gli screenshot con il tempo da parte dei suoi cliccatori più rapidi e fortunati.\r\nRingrazio però TUTTI voi per il tempo e l''attenzione dedicato.\r\nOra rimaniamo in attesa dell''esito concreto che Inail comunicherà sulla propria pagina ufficiale entro il 01/06/2016.\r\nPer il momento ci tengo a ringraziarvi nuovamente prima dei futuri sviluppi legati al risultato finale.', '2016-05-27 12:10:00', -1, -9, -1),
