(1792, 89, 'RE: RE: SCREENSHOT', 'ENTRO GIOVEDI A QUESTO LINK ESCONO LE GRADUATORIE: https://www.inail.it/cs/internet/attivita/prevenzione-e-sicurezza/agevolazioni-e-finanziamenti/incentivi-alle-imprese/bando-isi-2015.html?id1=2443085354680#anchor\r\n\r\nElenchi cronologici regionali.\r\nControlli il suo tempo in TOSCANA, e se il suo tempo è ion graduatoria utile la contattiamo noi.\r\n\r\nIntanto il contratto può caricarlo.\r\n\r\ncordiali saluti', '2016-05-30 14:24:00', 1169, -24, 1777),
