(1795, 5, 'AGGIORNAMENTI DA CLICK DAY', 'Ciao!\r\nEntro domani 1 di giugno 2016 (una settimana a partire dal 26 maggio giorno del click day) l’INAIL pubblicherà gli elenchi cronologici suddivisi per Regioni con la specifica dei progetti ammessi o meno a contributo riportando anche le tempistiche di invio.\r\nSarà nostra cura, non appena effettuati tutti i controlli del caso, comunicarvi: 1) Il link ufficiale dell’INAIL dal quale potrete controllare voi stessi se il vostro click è stato vincente; 2) La lista completa dei progetti inviati da ATS-CONSULENTI ASSOCIATI e, previo consenso degli interessati, anche il Nome, Cognome, Provincia di residenza del cliccatore più veloce a loro associato, quello cioè che ci ha inviato la schermata con evidenziato il tempo di presa in carico del server INAIL. Questa lista che sarà pubblicata solo sul portale clickdayats.it riporterà naturalmente solo i nominativi dei vincitori che avranno dato il loro consenso alla pubblicazione. \r\nAd oggi mancano ancora vari screenshot di progetti sicuramente presi in carico dall’INAIL, dunque solo per chi non l’avesse ancora fatto, vi invitiamo ad inviare urgentemente a  info@clickdayats.it i vostri screenshot, solo quelli riportanti il tempo di presa in carico del server INAIL (NON quelli in cui compare “Codice identificativo salvato”) in quanto in assenza di tale documento non potremo erogare il compenso previsto in caso di vittoria.\r\nLo Staff Click Day', '2016-05-31 13:40:00', -1, -15, -1),
(1796, 688, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Buonasera, nel caso non riceviate lo screenshot da parte di chi ha fatto in tempo, potreste darlo a chi è arrivato subito dopo.\r\n', '2016-05-31 13:52:00', 5, -23, 1795),
(1797, 796, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Ciao Alle,\r\n\r\nnon ho capito il discorso dello screenshot, dovevo farlo il 26 dopo aver inserito il codice e cliccato? In quel caso sicuramente non l''ho fatto :( Se invece c''è un modo di recuperarlo fammi sapere così lo faccio.\r\n\r\nGrazie mille,\r\nSoncio', '2016-05-31 14:07:00', 5, -23, 1795),
(1798, 1828, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Ciao, \r\nio lo screenshot non l''ho inviato all''indirizzzo di posta da voi citato, ma l''ho caricato nella pagina dell''area personale, dove richiesto. E'' necessario inviare comunque la mail?\r\ngrazie,\r\nalessio', '2016-05-31 14:08:00', 5, -23, 1795),
(1799, 1028, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Buongiorno.\r\nSono uscite le graduatorie sul sito dell''Inail, e la mia azienda cui fa riferimento il mio codice progetto è presente in graduatoria.\r\nDunque mi aggiudico il compenso?\r\n\r\nGrazie. Saluti\r\n\r\n', '2016-05-31 14:15:00', 5, -23, 1795),
(1800, 2068, 'Info', 'Buona sera io lo screenshot l ho inviato,quello che mi dava sul sito,quello vi ho mandato, dallo screenshot si vede comunque che erano le 16.02,il sito non ha mai dato il minutaggio,anche prima di cominciare ad inserire, eventualmente fate ulteriori controlli,cordiali saluti Tiziana', '2016-05-31 14:32:00', 88, -3, -1),
(1801, 264, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Salve, \r\nSono Chiara Verzelloni, ho già caricato la mia schermata sul sito internet che contiene l''orario di invio del click. Non capisco però come faccio a dare il consenso per la pubblicazione dei dati personali. Devo firmare il contratto riportato nella stessa schermata?\r\n\r\nCordiali saluti.\r\nChiara Verzelloni', '2016-05-31 15:04:00', 5, -23, 1795),
(1802, 844, 'RE: AGGIORNAMENTI DA CLICK DAY', 'buongiorno, \r\nio credo di aver sbagliato a salvare lo screenshot, mi chiedo se esiste una possibilità di recupero oppure no \r\ngrazie\r\nresto in attesa\r\ncordialmente\r\nstefania', '2016-05-31 15:25:00', 5, -23, 1795),
(1803, 5, 'PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Ciao!\r\nL’INAIL ha pubblicato gli Elenchi Cronologici con i risultati del Click Day, a partire da domani pomeriggio ( 1 giugno 2016) potrai scaricare, dalla tua area personale su clickdayats.it, la lista di tutti i nostri progetti inviati con le relative tempistiche di invio! I nomi dei cliccatori più veloci per ogni progetto verranno sistematicamente aggiunti alla lista mano a mano che otterremo il loro consenso Privacy. Puoi però, già da ora,  liberamente consultare gli elenchi cronologici dell’INAIL al seguente link https://www.inail.it/cs/internet/attivita/prevenzione-e-sicurezza/agevolazioni-e-finanziamenti/incentivi-alle-imprese/bando-isi-2015.html?id1=2443085354680#anchor per vedere se il tempo che ti è apparso nella schermata di presa in carico del codice progetto a te assegnato il giorno del click sia fra quelli ammessi a contributo. In alcuni casi i nomi delle Ditte inviate con il codice progetto nel file .TXT, rispetto a quelle che compaiono dell’INAIL possono differire per alcuni particolari come ad esempio “S.r.l.” con “Srl” oppure ALFA S.p.A. con Alfa S.p.A., non preoccuparti, se fatichi nel trovarle tramite la Ragione Sociale, cerca il tempo di invio! \r\nIn caso tu sia stato il cliccatore più veloce fra quelli associati al tuo stesso progetto, ed il progetto stesso sia stato ammesso a contributo, verrai contattato quanto prima per concordare le modalità di pagamento del tuo compenso. Ti ricordo, se per caso non l’hai ancora fatto, che per dimostrare che il click piu veloce è proprio il tuo, dovrai inviare lo screenshot riportante l’indicazione del tempo di presa in carico del server INAIL. Nel caso non lo avessi ancora fatto puoi inoltrarlo a: info@clickdayats.it\r\nGrazie!\r\nLo Staff Click Day\r\n', '2016-05-31 20:59:00', -1, -15, -1),
(1804, 666, 'Screen', 'Salve,\r\n\r\nho visto l''elenco e l''azienda per cui ho inviato il codice è in lista... Solo che non ho fatto lo screen. Lo so che è una mia pecca perché era scritto nella "istruzioni", ma lì per lì me ne sono completamente dimenticata... il danno è irreparabile, vero?\r\nMi scuso per la negligenza e vi ringrazio per la cortese attenzione.\r\n\r\nMartina', '2016-05-31 21:52:00', -1, -1, -1),
(1806, 736, 'RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Buongiorno, l''azienda che mi è stata affidata risulta essere negli elenchi ma quando ho fatto lo screenshot non è comparso il tempo, avete affidate a più persone la stessa azienda? perchè altrimenti non capisco.\r\nLa ringrazio.\r\nCordiali saluti', '2016-06-01 07:04:00', 5, -23, 1803),
(1807, 1814, 'RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Salve Alessandro, \r\navevo postato lo screenshot già il giorno stesso del clickday, spero vada bene. Inoltre. mi appaiono due spazi per il contratto, devo fare qualcosa a tal proposito? Credo di aver vinto il compenso visto che sono in graduatoria tra gli ammessi.', '2016-06-01 07:05:00', 5, -23, 1803),
(1808, 662, 'RE: SCHERMATA FINALE DI INVIO', 'quindi in pratica il mio click non è servito e non mi pagherete nulla?', '2016-06-01 07:05:00', 5, -23, 1643),
(1809, 438, 'Pagamento', 'Buongiorno, io ho trovato nelle liste Inail l''azienda riportata sul mio file TXT ed è stato concesso il contributo, questo significa che riceverò il mio pagamento? Se si quando? Tramite bonifico?', '2016-06-01 07:14:00', 88, -3, -1),
(1810, 88, 'RE: Pagamento', 'Salve Bilal, sfortunatamente qualcuno ha eseguito l''attività più velocemente di te, con il tempo 16.00.09.390.\r\n\r\nSaluti', '2016-06-01 07:18:00', 438, -24, 1809),
(1811, 46, 'RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Salve Alessandro\r\ndopo aver ricevuto stamattina la mail dell''INAIL mi è sorto un dubbio.\r\nIl compenso di cui parla in quale caso viene erogato?\r\nA me hanno parlato di 300€ nel caso in cui riuscissi a ricevere come schermata di output \r\n"la domanda di ammissione al contributo è pervenuta ai sistemi INAIL alle ore 26/05/2016 16.00.xx.xxx", il quale poteva aumentare fossi stato molto veloce.\r\nÈ corretto? o nel caso io non sia stato inserito in classifica, nonostante la dicitura nello screenshot, non vi sarà alcun compenso?\r\nGrazie mille\r\nScusi il disturbo\r\nElis', '2016-06-01 08:14:00', 5, -23, 1803),
(1812, 2092, 'RE: AGGIORNAMENTI DA CLICK DAY', 'Buongiorno!\r\nIo ho solo questo Screenshot.. riportante la scritta "codice identificativo salvato",\r\nperchè è l''unica schermata che mi ha dato dopo l''inserimento del codice alfanumerico..\r\ncome posso fare?', '2016-06-01 08:17:00', 5, -23, 1795),
(1813, 1911, 'Progetto accettato ma nel momento del click senza indicazione ora', 'Ciao, ho appena verificaro dagli elenchi pubblicati e ho visto che il mio progetto (I petali srl delle Marche) è stato accettato, ma il giorno del clickday non mi ha dato l''orario di registrazione, infatti nel mio screenshoot è visualizzato solo codice salvato, cosa devo fare?', '2016-06-01 08:33:00', 86, -3, -1),
(1818, 86, 'RE: Progetto accettato ma nel momento del click senza indicazione ora', 'Ciao,\r\nil progetto è passato grazie ad un cliccatore più rapido che ha "visto il tempo" e inviato noi la schermata. Spero che il prossimo anno sarà tuo il tempo così da beneficiare della retribuzione come da accordi con il ClickDay.\r\nQuindi per il momento non devi fare niente. Spero che l''esperienza ti serva davvero per migliorare la tua prestazione per il prossimo anno.\r\nbuona giornata!', '2016-06-01 09:38:00', 1911, -24, 1813),
(1819, 1646, 'informazioni', 'buongiorno, io avevo come progetto \r\n\r\nAzienda: IMPRESA MATTEI SRL\r\n\r\nRegione: EMILIA ROMAGNA\r\n\r\nandando a vedere sui registri la trovo fra quelle ammesse, il mio screenshot non riporta il tempo però. Come faccio a sapere se sono io o meno?', '2016-06-01 11:17:00', 86, -3, -1),
(1820, 6, 'RE: Screen', 'Buongiorno Martina, \r\npurtroppo non possiamo aiutarla, mi spiace molto.\r\nLo screen era l''unica ricevuta ufficiale grazie alla quale avremmo potuto verificare il suo progetto e di conseguenza pagarle l''eventuale compenso.\r\n', '2016-06-01 11:40:00', 666, -27, 1804),
(1821, 585, 'Impossibile download del contratto', 'Buongiorno, oggi ho provato a scaricare il contratto tramite l''area personale ma cliccando sul bottone "download" mi esce una pagina contenente una serie di errori PHP e non permette il download del file pdf.  Potrei avere una copia del contratto via mail?', '2016-06-01 12:19:00', 92, -3, -1),
