(1824, 933, 'Bonifico ', 'Buongiorno!\r\nMi è stato confermato oggi pomeriggio di essermi classificata come vincitrice del premio per il click più veloce. Ho già girato i miei dati bancari e ho caricato il contratto firmato. \r\nMi sapreste dire entro quanti giorni il bonifico verrà effettuato?\r\nGrazie mille', '2016-06-01 14:42:00', -1, -1, -1),
(1825, 318, 'RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Ciao, ho appena verificato che il mio click è stato preso in carico ed è stato ammesso.\r\n(verificato tempo invio)... adesso cosa devo fare? Devo spedirvi il contratto firmato?', '2016-06-01 14:57:00', 5, -23, 1803),
