(1827, 1868, 'lista cliccatori più veloci', 'Buongiorno,\r\n\r\nstamattina ho ricevuto una mail da Chiara\r\nper avere il mio consenso per pubblicare la lista dei cliccatori più veloci.\r\nIo non riesco a visualizzare né qs lista, né quella dei vincenti.\r\n\r\nGrazie\r\nemanuela', '2016-06-01 20:20:00', 161, -3, -1),
