(1834, 1225, 'verifica', 'CODICE PROGETTO\r\n+51d88c31a7f4a0ada3a8897f84fa2c7f476e9400a29d1738df33292973e6e656\r\nAzienda: R.G.SAS DI RICCIONI P.& C.\r\nRegione: UMBRIA\r\nènella lista dei progetti andati a buon fine, a me è uscita la scritta: "CODICE IDENTIFICATIVO SALVATO" senza il riferimento dell''orario.\r\nC''è stato qualcuno + veloce di me?', '2016-06-02 17:01:00', 89, -3, -1),
