(1839, 88, 'RE: Pagamento', 'Salve, \r\nha controllato se è uscito il tempo nella sua schermata (screenshot)?\r\nIn caso positivo, occorre confrontarlo a quello negli elenchi cronologici INAIL, e se dovesse combaciare, riceverà istruzione per essere pagato.\r\n\r\nSaluti', '2016-06-03 06:10:00', 438, -24, 1809),
(1840, 88, 'RE: Richiesta informazioni', 'Salve, ad oggi non necessitiamo.\r\n\r\nLa ringrazio.\r\nSaluti', '2016-06-03 06:11:00', 1181, -24, 1831),
(1841, 88, 'RE: click vincente ', 'Salve, \r\nha controllato se è uscito il tempo nella sua schermata (screenshot)?\r\nIn caso positivo, occorre confrontarlo a quello negli elenchi cronologici INAIL, e se dovesse combaciare, riceverà istruzione per essere pagato.\r\n\r\nSaluti', '2016-06-03 06:11:00', 394, -24, 1836),
(1842, 1357, 'STEROGLASS  REGIONE UMBRIA', 'Buongiorno, \r\nla società in oggetto compare nell''elenco degli ammessi al finanziamento,\r\nvorrei sapere a quanti è stato inviato il codice identificativo e chiaramente la dimostrazione che la suddetta società è entrata in graduatoria per mano di un click più veloce diverso dal  mio. Vorrei ricordare alla SV che probabilmente sarebbe bene comunicare all''INAIL  per i prossimi anni,  che all''inserimento di un codice già presente in archivio ovvero già preso in carico  appaia una scritta del tipo: " CODICE GIA'' PRESENTE" o quant''altro al fine di creare malintesi o confusioni su chi è stato più veloce di chi.\r\nRingrazio la SV per l''attenzione nell''attesa di una Vs cortese risposta\r\nDistinti Saluti\r\nDario Pisci', '2016-06-03 11:33:00', 162, -3, -1),
(1843, 1849, 'RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Ciao! Il mio progetto risulta tra quelli ammessi (S.E.A.F. SRL Emilia Romagna) sul sito Inail. Devo inviarvi il contratto per ricevere il contributo? ', '2016-06-03 12:51:00', 5, -23, 1803),
(1844, 1913, 'RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'salve, ho controllato la lista dei cliccatori vincenti e ci sono,ho pure inviato ad una sua collega ''''acconsento'''' dicendomi che adesso dovevo solo aspettare se l''inail aveva dato il contributo  o meno e c''è scritto nella lista che la mia azienda ha ottenuto l''importo,adesso cosa devo fare?', '2016-06-03 14:05:00', 5, -23, 1803),
(1845, 6, 'RE: STEROGLASS  REGIONE UMBRIA', 'Buongiorno Dario, \r\ncome già anticipato la listi dei progetti ammessi a contributo, fruibile dalla vostra area riservata su clickdayats.it, verrà aggiornata sistematicamente appena otterremo il consenso Privacy, con i nominativi e la provincia di residenza dei cliccatori più veloci,\r\ngrazie', '2016-06-03 14:41:00', 1357, -27, 1842),
(1846, 2133, 'Informazioni', 'Salve, \r\nHo partecipato al clickday, ho allegato lo screenshot ma non presenta l''ora dell''invio/ricezione. Sostanziamente penso di aver cliccato due volte sull''invio della richiesta, quindi la prima richiesta è arrivata al server dell''inal ma io non sono riusciuto a prendere lo screenshot perché ho riclickato sull''invio. Ora supponendo che il progetto a me assegnato abbia vinto,  non sarebbe comunque merito mio?Sopratutto se è stato assegnato solo a me o se nessuno degli altri a cui è stato assegnato corrisponde all''orario vincente?\r\nSaluti,\r\nPierluigi Greto\r\n', '2016-06-04 13:36:00', -1, -1, -1),
(1847, 6, 'RE: Informazioni', 'Buongiorno Pierluigi, se non è comparso il tempo significa che il suo click non è stato vincente, grazie', '2016-06-05 11:28:00', 2133, -27, 1846),
(1848, 161, 'RE: lista cliccatori più veloci', 'Ci scusiamo per il disguido.\r\nGli informatici mi dicono che si riesce a scaricare con Crhome, mentre sugli altri browser permangono problemi. Stanno lavorandoci per risolevere il problema.\r\nGrazie per la pazienza.\r\n\r\nCordiali saluti,\r\nMirco Siciliano', '2016-06-06 08:52:00', 1868, -24, 1827),
(1849, 736, 'CHIARIMENTO ', 'Buongiorno, l''azienda che mi è stata affidata risulta essere negli elenchi ma quando ho fatto lo screenshot non è comparso il tempo, avete affidate a più persone la stessa azienda? perchè altrimenti non capisco. La ringrazio. Cordiali salut', '2016-06-06 10:18:00', 88, -3, -1),
(1850, 88, 'RE: CHIARIMENTO ', 'Salve Matteo,  \r\n\r\ncome detto in precedenza, ogni codice progetto aveva circa 15 cliccatori.\r\n\r\nNel caso in cui non le sia comparsa la schermata con la tempistica di esecuzione del click, un''altra persona ha completato il click prima di lei.\r\n\r\nSaluti', '2016-06-06 10:20:00', 736, -24, 1849),
(1851, 1418, 'RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Buongiorno, ho verificato che la pratica inserita da me (p111MARIAN) è stata ammessa al contributo INAIL; potrei avere informazioni in merito al corrispettivo nei miei confronti?\r\nVi ho inviato (upload) anche il contratto firmato, ma non è ancora presente il mio nominativo nella lista progetti inviati, in corrispondenza della pratica p111MARIAN.\r\n\r\nAttendo vostro riscontro,\r\ncordiali saluti', '2016-06-06 15:39:00', 5, -23, 1803),
(1852, 5, 'RE: RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Buongiorno Alessio,\r\n                 il click più veloce associato al suo progetto non è stato inviato da lei ma da un''altro cliccatore. Infatti nello screenshot che ci ha inviato non compare il suo tempo di invio. Può visionare la lista con i tempi dei nostri progetti e i nominativi dei cliccatori vincenti accedendo alla sua area personale di clickdayats.it. Tale lista viene aggiornata sistematicamente non appena otteniamo il consenso alla pubblicazione dei dati personali dei cliccatori.\r\n\r\nSaluti Cordiali\r\nAlessandro', '2016-06-06 15:50:00', 1418, -27, 1803),
(1853, 1418, 'RE: RE: RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Forse non ho capito: la pratica p111MARIAN è stata affidata a più persone? Il timer con il conto alla rovescia non è stato caricato dalla pagina del browser; per cui, non sapendo come fare, ho inviato lo screenshot della pagina che si era caricata.\r\n', '2016-06-06 15:58:00', 5, -23, 1803),
(1854, 5, 'RE: RE: RE: RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Infatti il suo screenshot era quello che correttamente doveva inviarci. Come spiegato nel tutorial video le schermate che potevano comparire erano di due tipologie, la prima con la presa in carico e la comparsa del tempo di invio e quindi con la possibilità che l''azienda a lei associata ottenesse il contributo e che quindi anche lei ottenesse il compenso, la seconda con una schermata di salvataggio che significava che un''altro cliccatore, associato al medesimo codice progetto, aveva inviato il tutto in un tempo inferiore.\r\n\r\nSaluti\r\nAlessandro', '2016-06-06 16:12:00', 1418, -27, 1803),
(1855, 1418, 'RE: RE: RE: RE: RE: PUBBLICAZIONE ELENCHI CRONOLOGICI INAIL!', 'Molto interessante...', '2016-06-06 16:17:00', 5, -23, 1803),
(1856, 1357, 'RE: RE: STEROGLASS  REGIONE UMBRIA', 'Buonasera, \r\nil nome, il cognome e la regione di residenza del cliccatore per la società in oggetto  nn compare nell''elenco. Io ho inviato lo screenshot  con la dimostrazione dell''invio del codice di identificazione relativo alla stessa. Attendo Vs notizie', '2016-06-06 17:20:00', 6, -23, 1842),
