(1859, 88, 'RE: orario di invio', 'Salve Francesca,\r\n\r\nnel caso in cui non abbia lo screenshot dell''orario di invio del progetto, come anticipato nel tutorial, non è possibile ottenere il compenso.\r\n\r\nSaluti', '2016-06-07 07:36:00', 1172, -24, 1858),
