(1863, 88, 'RE: clik day', 'Salve, \r\nil premio lo ha già ricevuto la persona che ha avuto il tempo. Non vede il nome perchè probabilmente non ha acconsentito alla pubblicazione, per questioni di privacy.\r\n\r\nSaluti', '2016-06-09 09:17:00', 1172, -24, 1862),
(1864, 932, 'Informazioni Lista Cliccatori Vincenti', 'Buongiorno,\r\nvorrei delucidazioni sulla lista in oggetto. Il mio progetto è stato approvato, ma nella lista non è visualizzato il mio nome. Perchè?\r\nGrazie.\r\nDaniela Tavano', '2016-06-13 07:03:00', -1, -1, -1),
(1865, 5, 'RE: Informazioni Lista Cliccatori Vincenti', 'Buongiorno Daniela,\r\n               non compare alcun nominativo in quanto non ci risulta alcuno screenshot, da lei inviato, a comprova dell''inoltro del codice progetto. Come ha certamente letto sul contratto e visionato nel tutorial senza tale ricevuta non possiamo erogare il compenso. Se ci invia, anche su info@clickdayats.it, la schermata di presa in carico del progetto riportante il tempo esatto di invio (così come riportato anche negli elenchi cronologici Pubblici dell’INAIL) del progetto a lei assegnato la contatteremo per l''erogazione del compenso.\r\n\r\nMi faccia sapere. Se ha altri dubbi mi chiami pure allo 0522/701079\r\n\r\nAlessandro', '2016-06-13 11:34:00', 932, -27, 1864),
(1866, 932, 'RE: RE: Informazioni Lista Cliccatori Vincenti', 'Buongiorno Alessandro, \r\nho provato a carica lo screenshot sulla mia pagina personale, ma mi segnala un errore.\r\nL''ho inviato stamattina all''indirizzo email info@clickdayats.it.\r\nGrazie.\r\nDaniela', '2016-06-13 11:38:00', 5, -23, 1864),
(1867, 2031, 'AVVENUTO PAGAMENTO', 'Buongiorno, vorrei gentilmente sapere se il versamento è stato effettuato al conto da me indicato poichè ancora non ho ricevuto notifica dello stesso.\r\nCordiali Saluti', '2016-06-14 08:44:00', -1, -1, -1),
(1868, 6, 'RE: AVVENUTO PAGAMENTO', 'Buongiorno,\r\nè stato emesso il bonifico oggi oggi, quindi dovrebbe vederlo addebito sul suo conto corrente fra domani e venerdì, grazie', '2016-06-14 13:40:00', 2031, -27, 1867),
(1869, 2123, 'Compenso', 'Buongiorno,  il mio click è in lista, ma come bisogna fare per aver il compenso?\r\nSaluti', '2016-07-29 10:09:00', -1, -1, -1);
